                        <img src="https://www.ariscorp.de/assets/img/excurs/util/NaviTimeline.png" usemap="#image-map2">

                        <h1 class="short-hr-left" style="font-family: 'Nasa'; float: left;">Excurs - Geschichte</h1>

                        <h6 id="2075"><img class="aligncenter" src="https://robertsspaceindustries.com/media/puvp3i50x7n2qr/post_section_header/NewsScreen.jpg"/></h6>
                        <h6>2075: Die Sterne r&uuml;cken ein wenig n&auml;her</h6>
                        <p><img class="alignright" src="https://robertsspaceindustries.com/media/hsauf9fwc7tzpr/post/TeaserTest1_7.jpg"/>Der Tag des 3. Mai 2075 begann wie jeder andere. Rebecca Childress sa&szlig; am Esstisch und malte, w&auml;hrend ihre Mutter die Morgen-Nachrichten im Fernsehen schaute. Es war einer jener Momente, die Rebecca am meisten liebte, wie sie sp&auml;ter erinnerte. Dieser Tag jedoch w&uuml;rde ihr im Ged&auml;chtnis bleiben, genauso wie jedem anderen auf dem Planeten.</p>
                        <p><em>Auszug aus Rebecca Childress Tagebuch:</em></p>
                        <p>&bdquo;Mama hat heute wieder Eierkuchen gemacht. Ich malte, als Papa auf dem Holo auftauchte. Ich rief nach Mama. Danny fing an zu schreien und rannte um den Tisch herum. Es war so nervig! Doch dann war da Papa, er stand gleich neben dem Pr&auml;sidenten. Sie redeten &uuml;ber den Weltraum und noch andere Sachen und er sah dabei so wichtig aus. Wir hatten ihn schon lange nicht mehr gesehen. Er trug nun einen Bart. Mama mochte es nicht, aber ich fand, es sah lustig aus. Immer wenn Papa aus dem Haus ging, fragte ich ihn, warum er die ganze Zeit arbeiten musste und er sagte mir immer das Gleiche: Er versuchte, mir die Sterne zu schenken.&ldquo;</p>
                        <p>Dr. Scott Childress und sein Team hatten es geschafft, den ersten sich selbst versorgenden Quantum Drive zu entwickeln, der in der Lage war, 1/100 der Lichtgeschwindigkeit zu erreichen. Zum ersten Mal konnte die Menschheit das Sonnensystem mit bis dahin beispielloser Geschwindigkeit entdecken.</p>
                        <hr id="2113"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/w8c8nsidbhm2kr/post_section_header/NewspaperCU2_Crop.jpg"/></h6>
                        <h6>2113: Wann gehen wir zu weit?</h6>
                        <p>Editorial from United Times Archive<br>
                        Published April 21, 2113<br>
                        von Hannigan Terrell</p>
                        <p>Falls Sie bis zur vergangenen Woche nicht unter einem Stein gelebt haben, so haben Sie ohne Zweifel von RSIs letzter gro&szlig;er Errungenschaft geh&ouml;rt. F&uuml;r alle Steinbewohner: Lassen Sie mich wiederholen, worum es geht. Sie geben an, &bdquo;eine Maschine entwickelt zu haben, die die Atmosph&auml;re eines Planeten in eine nachhaltig atembare Sauerstoff-Umgebung umwandeln kann, die f&uuml;r Menschen atembar ist.&ldquo; Kurz gesagt: Sie reden &uuml;ber Terraforming. Ja ganz recht, das Zeug, das Sie bislang nur aus Science-Fiction kannten.</p>
                        <p>Ich wei&szlig;, jedermann ist nun aufgeregt wegen der M&ouml;glichkeiten, die sich daraus ergeben. Aber niemand scheint mal kurz Atem zu holen und dar&uuml;ber nachzudenken, was das wirklich bedeutet.</p>
                        <p>Einmal mehr ist es daher an mir, die Stimme der Vernunft zu sein bei dieser ganzen Technik-Hysterie. Ganz recht, liebe Leser, ich stelle also nun die entscheidende Frage, die sonst offenbar niemand stellt.</p>
                        <p>Wenn wir einen Planeten terraformen k&ouml;nnen &ndash; warum sollten wir?</p>
                        <p>Ich gebe Euch eine Sekunde. Denkt dar&uuml;ber nach! Nur weil wir etwas tun k&ouml;nnen, sollten wir es deshalb auch? Ich wei&szlig;, die Gelehrten dr&uuml;ben auf SSNtv werden mich l&auml;cherlich machen, machen aus mir einen Technikfeind, aber ich sage Euch etwas: Ich habe kein Problem mit Klonen, ich habe auch kein Problem mit Gene-Coding, um ererbte Schw&auml;chen oder Krankheiten zu korrigieren. Diese Dinge sind Erfolge, um das Leben zu verbessern.</p>
                        <p>Aber wof&uuml;r ist das hier? Wem hilft es? An welchem Punkt gehen wir zu weit? Ernsthaft, wir reden hier dar&uuml;ber, die gesamte Atmosph&auml;re eines Planeten zu restrukturieren. Und die Planeten, &uuml;ber die wir hier reden, wurden aus einen bestimmten Grund so gemacht, wie sie sind. Wer glauben wir, dass wir sind, dass das Universum will, dass wir Planeten so umgestalten, dass sie uns zum Vorteil gereichen? Wir sind keine G&ouml;tter und mit dem grundlegenden Zusammenbau eines Planeten herumzuspielen, ist arrogant und gef&auml;hrlich. Ich wei&szlig;, dies wird wahrscheinlich auf taube Ohren sto&szlig;en. Die Welt sonnt sich zu sehr in ihrer eigenen Herrlichkeit, aber ich verspreche Euch: Es wird hierbei nichts Gutes herauskommen.</p>
                        <hr id="2120"><p><img class="aligncenter" src="https://robertsspaceindustries.com/media/7e1mr7g2ycanhr/post_section_header/MarsTerraform_Final2b.jpg"/></p>
                        <h6>2120: Gebt den Menschen Luft</h6>
                        <p>Nach Jahren der Simulationen und der Tests, hat die Weltregierung beschlossen, ihr Wissen und ihre Ressourcen in ein ehrgeiziges Projekt zu stecken: Den Versuch der ersten Planeten-Umwandlung.</p>
                        <p>Das Test&ndash;Objekt ist der Mars.</p>
                        <p>Teams von Landvermessern wurden auf die Planeten-Oberfl&auml;che gebracht, um topografische Karten zu erstellen, um zu entscheiden, wo die Atmosph&auml;ren-Umwandler platziert werden sollen und um Bodenproben auf etwaige Verunreinigungen in der neuen Sauerstoff-Atmosph&auml;re zu &uuml;berpr&uuml;fen. Es war unsere erste Komplett-Erkundung unseres Nachbarplaneten und die Regierungen der Welt haben wirklich nichts dem Zufall &uuml;berlassen&hellip;</p>
                        <hr id="2125"><p><img class="aligncenter" src="https://robertsspaceindustries.com/media/r6xy7pxj64sg0r/post_section_header/DarkDay_FI1.jpg"/></p>
                        <h6>2125: Ein dunkler Tag</h6>
                        <p>Quelle: Sentinel NewsOrg<br>
                        Uploaded: Mid-Atlantic Servers @ 7:53EST<br>
                        Autor: Kelsey Forset<br>
                        START FILE . . .</p>
                        <p>Heute ist ein dunkler Tag. Im Streben nach menschlichem Fortschritt, tendiert das Buch der Geschichte dazu, die tapferen M&auml;nner und Frauen hervorzuheben, die erfolgreich waren. Die Gebr&uuml;der Wright, die John Glenns oder Edwin Pierces haben sich dadurch ausgezeichnet, dass sie diejenigen waren, die ihr Ziel erreichten. Aber um das Denkmal jeden Erfolges liegen auch die K&ouml;rper derjeinigen, die es versucht haben und es nicht schafften.</p>
                        <p>Heute ist ein dunkler Tag und heute gedenken wir denjenigen mutigen M&auml;nnern und Frauen, die ihre Leben in der Trag&ouml;die verloren haben, die sich heute fr&uuml;h um 04:38 EST auf dem Mars ereignet hat.</p>
                        <p>W&auml;hrend die &Ouml;ffentlichkeit noch darauf wartet, was genau passiert ist, weisen unserer Quellen darauf hin, dass eine chemische Fehlkalkulation in den Atmosph&auml;ren-Umwandlern die neue Atmosph&auml;re instabil werden lie&szlig;. &bdquo;Die Atomsph&auml;re hat nicht gehalten&ldquo;, sagte ein Regierungsmitglied, das nicht genannt werden will. Der Planet befand sich in der letzten Stufe des Terraforming-Prozesses.</p>
                        <p>Eine sauerstoffhaltige Umgebung war zwei Wochen zuvor induziert worden. Die Wissenschaftler auf dem Planeten waren nur noch zwei Tage davon entfernt, den Planeten offiziell f&uuml;r sicher zu erkl&auml;ren. Das Vertrauen in die Atmosph&auml;re hatte zur Folge, dass niemand in der Crew seine Sauerstoffger&auml;te angelegt hatte. W&auml;hrend dies rein technisch eine Verletzung des Arbeitsprotokolls ist, so wurde uns gesagt, gab es f&uuml;r die Bodencrew keinerlei Hinweis darauf, dass mit der Atmosph&auml;re etwas nicht stimmen k&ouml;nnte. Was schlie&szlig;lich auch verantwortlich war &ndash; es passierte jedenfalls so schnell, dass niemand dazu in der Lage war, einen Alarm auszul&ouml;sen oder die die Bel&uuml;ftung der verschiedenen Anlagen auf dem Planeten zu versiegeln.</p>
                        <p>Ohne Zweifel wird diese Trag&ouml;die die bereits lang anerkannten Argumente und die Vorteile des Terraformings wieder in Zweifel ziehen. Die Pr&auml;sidentin hat heute Morgen in ihrem Blog-Statement bekanntgegeben, dass m&ouml;glicherweise ein internationales Komitee untersuchen soll, wie es von hier aus weitergehen soll.</p>
                        <p>&bdquo;W&auml;hrend ich verstehe, dass das Terraforming Gef&uuml;hle daf&uuml;r und dagegen ausl&ouml;st, sind 4876 Seelen gestorben, w&auml;hrend sie daran arbeiteten, die Menschheit vorw&auml;rtszubringen. Wir m&uuml;ssen sicherstellen, zu welcher Entscheidung wir auch immer kommen, dass wir uns weiter vorw&auml;rtsbewegen, w&auml;hrend wir gleichzeitig die Opfer der Trag&ouml;die des Mars ehren.&ldquo;</p>
                        <p>&hellip; end file.</p>
                        <hr id="2140"><p><img class="aligncenter" src="https://robertsspaceindustries.com/media/tcujekb65lbc5r/post_section_header/RSIZeus_Ad_FI_2.jpg"/></p>
                        <h6>2140: Ein Schiff in jeder Garage</h6>
                        <p><img class="alignright" src="https://robertsspaceindustries.com/media/w0fm6pkj9y85vr/post/RSIZeusAd_2.jpg"/>Hatte die Erfindung des RSI Quantum Drive das Sonnensystem mehr zug&auml;nglich gemacht, so war es immer noch die Dom&auml;ne der Regierungen, der wachsenden Unternehmensflotten und der Super-Reichen. Aber das w&uuml;rde sich bald &auml;ndern&hellip;</p>
                        <p>&nbsp;</p>
                        <p>&nbsp;</p>
                        <p>&nbsp;</p>
                        <p>&nbsp;</p>
                        <hr id="2157"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/ve1gus81zoixrr/post_section_header/Marssurface3_FI.jpg"/></h6>
                        <h6><strong>2157: Blauer Himmel auf dem Mars </strong></h6>
                        <p>Nach fast vierzig Jahren Versuch und Trag&ouml;die ist der Mars offiziell nun als ein Planet mit sauerstoffhaltiger Atmosph&auml;re klassifiziert. F&uuml;r diejenigen, die bei der gro&szlig;en Mars-Trag&ouml;die im Jahr 25 gestorben sind, wurde nun feierlich ein Denkmal eingeweiht. Senator Steven Nguyen war der Hauptredner.</p>
                        <p>Dies ist die Niederschrift seiner Ansprache:</p>
                        <p>Mein Bruder Sean liebte es zu bauen. Als wir Kinder waren, war ich derjenige, der Sport trieb und der f&uuml;r den Studentenausschuss antrat. Er hat immer mit Dingen herumgebastelt. Es war nicht ungew&ouml;hnlich bei uns Zuhause, dass man heim kam und ein technisches Ger&auml;t war auseinandergebaut und auf dem Wohnzimmerboden ausgebreitet. Oder Sean krabbelte in den Ventilationssch&auml;chten umher, weil er ein Klickger&auml;usch geh&ouml;rt hatte. Obwohl er erst zehn Jahre alt war, war er schon so begabt. Vielleicht ist begabt das falsche Wort, weil es nicht nur sein Talent war, sondern vielmehr seine Neugier und sein Vergn&uuml;gen daran, Dinge auseinander zu nehmen und zu schauen, wie alles zusammen gesetzt war. Als die Jahre voranschritten, haben wir uns auseinander entwickelt.</p>
                        <p>Er war mein kleiner verr&uuml;ckter Bruder, der mein Zeug auseinandernahm. Wir gingen auf beiden Seiten der Welt zur Schule. Er studierte Ingenieurswesen und Physik, was keine &Uuml;berraschung war. Ich machte mein Ding. Als Erwachsene haben wir uns regelm&auml;&szlig;ig getroffen, aber ich w&uuml;rde nicht sagen, dass wir wirklich eng miteinander waren. Mehr wie Bekannte als Br&uuml;der. Wir waren einfach zu verschieden. Ich mochte die Phoenix Five, aber er dachte, sie seien nur ein Abklatsch. Ich dachte, das neue B&uuml;rgerschaftsprogramm w&auml;re ein guter Weg, um Menschen zu belohnen, die aktiv eine bessere Nation aufbauen wollten. Er dachte, das w&auml;re nur etwas f&uuml;r die Elite. Und so ging es weiter.</p>
                        <p>Viele Jahre zuvor, als ich meinen ersten Sitz im Distrikt gewann, kam Sean zur Siegerparty. Ich dachte, ein Wahlhelfer musste ihn eingeladen haben. Um ehrlich zu sein, ich h&auml;tte es nicht einmal probiert. Einer aus meinem Team sah ihn in einer Ecke stehen. Offenbar f&uuml;hlte er sich unwohl in der Menge. Er kam nicht einmal her&uuml;ber, um mit mir zu sprechen. Er schrieb nur eine Notiz und bat jemanden, mir diesen Zettel zu geben.</p>
                        <p>Dies ist, was darauf stand:</p>
                        <p>&bdquo;Hey Stephen. Du sahst aus, als m&uuml;sstest Du mit einer Menge Leute sprechen. Das wollte ich nicht unterbrechen. Aber ich m&ouml;chte sagen, Du bist gro&szlig;artig, Mann! Ich wei&szlig;, wir zanken und streiten. Aber es gibt mir Hoffnung, dass jemand, der an seine &Uuml;berzeugung glaubt, in die Regierung geht. Es ist wirklich aufregend und ich freue mich f&uuml;r Dich! Erinnere Dich stets daran, egal welche H&auml;&szlig;lichkeiten Dich umgeben. Sei mutig, tapfer, sei Du selbst und dann wird es ok sein.&ldquo;</p>
                        <p>Mein Bruder Sean. Sean, der Zerst&ouml;rer. Sean, der Reparierer. Sean war einer derjenigen, die in der Trag&ouml;die von 2125 gestorben sind. Seitdem konnte ich nie wieder eine seiner &auml;rgerlichen Tiraden &uuml;ber Politik oder eine seiner l&auml;cherlichen Ausschweifungen &uuml;ber Legierungen oder Sollbruchstellen h&ouml;ren. Es ist ein Trost, dass das Projekt, das meinen Bruder das Leben gekostet hat, nun abgeschlossen ist. Dieses Denkmal, ein kleiner Trost, verglichen mit dem Verlust all dieser Leute, wird ihre Namen f&uuml;r den Rest der Menschheit f&uuml;r immer im Ged&auml;chtnis halten. Und wissen Sie was? Vergeben Sie mir meine Unverbl&uuml;mtheit. Ich m&ouml;chte nicht, dass Menschen auf dieses Denkmal schauen und ruhig und in sich gekehrt sind. Ich m&ouml;chte, dass die Namen in den Felsen gemei&szlig;elt sind, um ein Feuer zu entz&uuml;nden. Ein Feuer, das uns und die Menschheit herausfordert. Ich m&ouml;chte, dass die Namen eine Aufforderung f&uuml;r uns alle sind, um uns hervorzutun und um unser Schicksal im Universum zu finden.</p>
                        <p>Um es in den Worten meines kleinen, dummen Bruders zu sagen: Seid tapfer. Seid ihr selber, Und alles wird gut.</p>
                        <hr id="2214"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/svh68wietzbspr/post_section_header/ScienceTextbook_1_FI.jpg"/></h6>
                        <h6>2214: Der Weg des Fortschritts</h6>
                        <p><img class="alignright" src="https://robertsspaceindustries.com/media/av6skny9zt2ehr/post/ScienceTextbook_2-740x416.jpg"/>Als RSI die n&auml;chste Generation des Fusion-Antriebs ank&uuml;ndigte, er&ouml;ffneten sich neue und aufregende Aussichten f&uuml;r die Raumfahrt &ndash; aber nicht jeder war so begeistert.</p>
                        <p>Bailey konnte es nicht glauben. Er sa&szlig; seit 20 Minuten im Physik-Unterricht und nun erhielt er einen neuen Download. Irgendeine neue Maschinen-Technologie. Als er heute Morgen zur T&uuml;r hinaus gegangen war, hatte er schon einen fl&uuml;chtigen Blick darauf geworfen aber erst jetzt erfolgte das Update der Schulb&uuml;cher.</p>
                        <p>&nbsp;</p>
                        <p>&nbsp;</p>
                        <hr id="2232"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/mh01k2npo9q11r/post_section_header/ArtemisLaunch_FI.jpg"/></h6>
                        <h6>2232: Der erste Vorsto&szlig;</h6>
                        <p>Die Artemis war ein wahrgewordener Traum. Nach der Ank&uuml;ndigung ein Raumschiff zu bauen, um zum n&auml;chsten bewohnbaren Planeten vorzusto&szlig;en, flippte die &Ouml;ffentlichkeit aus. Fremde Welten und erste Kontakte war nicht mehr allein die Dom&auml;ne von Science-Fiction-Autoren, es wurde aufregende Realit&auml;t. Das Schiff wurde mit Stasis-Kammern, Terrafroming-Ausr&uuml;stung und k&uuml;nstlicher Intelligenz am Steuer ausger&uuml;stet. F&uuml;nftausend Seelen bot das Schiff Platz.</p>
                        <p>Es erfolgte ein Aufruf f&uuml;r Freiwillige.</p>
                        <p>Niemand spielte die Risiken herunter, von denen es viele gab. Bei einer nachhaltigen Verbrennung mit den neuesten Antrieben w&uuml;rde die Artemis &uuml;ber zweihundert Jahre brauchen, um ihr Ziel zu erreichen. In dieser Zeit kann viel passieren. Trotzdem gab es &uuml;ber eine Million Freiwillige. Aussch&uuml;sse filterten die Listen und versuchen, die beste Kombination von F&auml;higkeiten und Disziplinen zu finden.</p>
                        <p>Das Folgende sind Ausz&uuml;ge aus &bdquo;Chariot to the Stars&ldquo;, dem offiziellen Logbuch zum Launch, basierend auf den kompilierten Flugprotokollen, pers&ouml;nlichen Tageb&uuml;chern und Zeugenaussagen.</p>
                        <p><em>ZEITSTEMPEL: Start = -0d14h38m13s</em><br>
                        Am Vorabend des Starts von Artemis pr&uuml;fte Captain Lisa Danvers die Schalttafeln unter der Comm-Station auf der Br&uuml;cke &hellip; zum nunmehr dritten Mal.</p>
                        <p>Arthur Kenlo, Ingenieur, sa&szlig; auf der Lehne des Captains Stuhls. Er hatte es aufgegeben, herauszufinden, wonach sie suchte. Lisa Danvers hatte immer ein Problem mit gro&szlig;en Schiffen. Sicher, sie hatte schon vorher Transporte geflogen, aber das war etwas anderes. Es gab tausend Dinge, die schief gehen konnten, was wiederum eine Million Funktionen beeinflussen konnte. Es war zum wahnsinnig werden.</p>
                        <p>&ldquo;Sind Sie sicher, dass ich Ihnen nicht helfen kann, Captain?&rdquo;, sagte eine k&ouml;rperlose Stimme, die aus Dutzenden von versteckten Lautsprechern auf der ganzen Br&uuml;cke zu kommen schien. Es war die KI, hilfreich wie immer. &ldquo;Nein, mir geht es gut&rdquo;, sagte Danvers und Kenlo murmelte die Worte mit. Danvers konnte nichts Falsches oder Verd&auml;chtiges in den unz&auml;hligen Leiterplatten entdecken. Sie hasste die Angst vor dem Flug. Egal was sie tat, es traf sie immer schwer. Sie ersetzte das Panel.</p>
                        <p>Kenlo wurde munterer.</p>
                        <p>&ldquo;Geht es Dir gut?&rdquo;</p>
                        <p>&ldquo;Ja ich glaube schon. Hey Janus? &rdquo;</p>
                        <p>&ldquo;Ja, Captain?&rdquo;, antwortete die k&ouml;rperlose Stimme.</p>
                        <p>&ldquo;Erzeuge eine weitere Reihe von Notfallaktionen f&uuml;r die Stasis-Kammern.&rdquo;</p>
                        <p>&ldquo;Haben Sie bestimmte Parameter?&rdquo;</p>
                        <p>&ldquo;Nein, nutze deine Vorstellungskraft.&rdquo;</p>
                        <p>&ldquo;Das ist ein Konzept, von dem ich nur ein begrenztes Verst&auml;ndnis habe.&rdquo;</p>
                        <p>&ldquo;Au&szlig;erhalb der Box. Etwas, an das wir nicht gedacht haben. &rdquo;</p>
                        <p>&ldquo;Ich werde es versuchen, Captain.&rdquo;</p>
                        <p>In dieser Nacht versuchte Janus, der KI-Kern, Vorstellungskraft zu entwickeln.</p>
                        <p><em>ZEITSTEMPEL: Start = -0d0h4m21s<br></em>Am n&auml;chsten Morgen wartete die Welt. Die Freiwilligen waren bereits auf einer Orbitalplattform. Die Ingenieure waren der Meinung, dass es einfacher w&auml;re, sich die M&uuml;he zu ersparen, Startsitze f&uuml;r f&uuml;nftausend Menschen zu bauen. So waren sie in den vergangenen Wochen in Gruppen dorthin gebracht worden. Heute war der Start der Artemis selbst. Danvers und ihre Kernmannschaft w&uuml;rden sie hochfliegen und dann an der Plattform andocken, um die Zivilisten und alle Last-Minute-Lieferungen abzuholen. NewsOrgs aus der ganzen Welt waren zusammengekommen, um den Moment in jedem erdenklichen Format festzuhalten und alles auf den Bildschirm zu bringen.</p>
                        <p>Lisa war schon festgeschnallt, die Ersch&uuml;tterungen der letzten Tage schmolzen mit jedem verstreichenden Moment dahin. Sie starrte auf die Hauptprojektionsfl&auml;che. Diese zeigte die Vorderansicht des Schiffes. Im Moment war dort nur eine versiegelte Startr&ouml;hre zu sehen. Sie dachte dar&uuml;ber nach, was dahinter lag, der Himmel. Der Himmel, den sie liebte. Er wartete darauf, dass sie zur&uuml;ckkam.</p>
                        <p>Danvers ging ihre Preflight-Checklists durch. Sie war gr&uuml;ndlich und professionell, aber es ging ihr nicht schnell genug. Die Crew war eingecheckt, alles war gr&uuml;n auf der ganzen Linie. Es folgte ein letzter Check-in mit der Flugkontrolle. Sie waren bereit.</p>
                        <p>Es war an der Zeit. Vor dem Schiff begann es zu piepsen. Die massiven Metalltore der Abschussrampe entriegelten sich mit schweren Schl&auml;gen.</p>
                        <p>&ldquo;Captain Danvers, soll ich die Kontrolle &uuml;bernehmen?&ldquo;, fragte Janus.</p>
                        <p>&ldquo;Nein, ich habe sie.&rdquo;</p>
                        <p>&ldquo;Sind Sie sicher, Kapit&auml;n?&rdquo;</p>
                        <p>&ldquo;Ich bin sicher.&rdquo;</p>
                        <p>Die Tore begannen sich zu bewegen. &ldquo;Aber Captain, ich habe einen Fehlerquotienten von 0,002.&rdquo;</p>
                        <p>&ldquo;Zeig mir einfach den Himmel. Ich werde uns dorthin bringen. &rdquo;</p>
                        <p><em>ZEITSTEMPEL: Start = + 9d5h12m57s<br></em>Janus &uuml;bernahm die Kontrolle und kreiste f&uuml;r eine Woche, nachdem die Besatzung und die Zivilisten in die Stasis eingetreten waren, um nach Fehlern oder Anomalien zu suchen. Es war ein Testlauf daf&uuml;r, wie das Schiff sich verhalten w&uuml;rde, wenn es seinen Vorsto&szlig; ins Unbekannte starten w&uuml;rde. G&auml;be es irgendwelche Probleme, konnte die Flugkontrolle den Start abbrechen und das Schiff fernsteuern, wenn es sein musste. Die Flugkontrolle beendete ihre abschlie&szlig;ende Bewertung aller Kontrollen. Alles sah gut aus. Justin Cobb, der Missionsdirektor, blickte &uuml;ber die Menge der Techniker, Wissenschaftler und Analysten, die vor ihm sa&szlig;en.</p>
                        <p>&ldquo;Geht es allen gut?&rdquo;</p>
                        <p>Jeder nickte.</p>
                        <p>&ldquo;Dies ist unsere letzte Chance. Wenn irgendjemand geringste Bedenken hat, so sagt er sie jetzt besser. Es ist mir egal, wie es klingt oder ob Leute im Management ausflippen. &rdquo;</p>
                        <p>Ruhe.</p>
                        <p>Cobb lie&szlig; ein paar Augenblicke verstreichen, nickte, um dann den Kontakt zur Artemis herzustellen.</p>
                        <p>&ldquo;Guten Tag.&rdquo;</p>
                        <p>&ldquo;Wie geht es dir, Janus?&rdquo;</p>
                        <p>&ldquo;Ich habe Simulationen durchgef&uuml;hrt. Notfall-Szenarien. Darunter zuf&auml;llige Stromschwankungen, einen Zusammensto&szlig; mit einem Fremdk&ouml;rper, einen Kontakt mit neuem, nicht kategorisiertem Gas oder Element oder Kontakt mit feindlichen Organismen. &rdquo;</p>
                        <p>&ldquo;Irgendwelche Schlussfolgerungen?&rdquo;</p>
                        <p>&ldquo;Ich denke, wir werden alle zufriedenstellen.&rdquo;</p>
                        <p>Cobb warf einen Blick auf den ihm am n&auml;chsten sitzenden Techniker, der von der Sprache der KI offenbar verwirrt war.</p>
                        <p>&bdquo;Du denkst?&rdquo;</p>
                        <p>&ldquo;Ich kann mir vorstellen, dass es gut geht, Mr. Cobb.&rdquo;</p>
                        <p>Zweiundzwanzig Minuten sp&auml;ter gab die Artemis f&uuml;r siebzig Minuten Vollschub. Es ging &uuml;ber den Rand unseres Sonnensystems hinaus in dieses gro&szlig;e Meer des Weltraums hinaus in das stille Schwarz, das uns umgibt.</p>
                        <p>Und so warten wir, tr&auml;umen von den Dingen, die sie finden werden, in der Hoffnung, dass wir eines Tages von den tapferen M&auml;nnern und Frauen, die die Artemis bestiegen haben, h&ouml;ren werden. Als Botschafter der Vereinigten Erde.</p>
                        <hr id="2262"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/p2enri0svprmcr/post_section_header/BlackBoxGraphic_1.jpg"/></h6>
                        <h6>2262: Das Neso-Dreieck</h6>
                        <p>Sace wurde zu einem gesch&auml;ftigen Ort. Schiffe aller Art, f&ouml;derale, kommerzielle und private, erkundeten die R&auml;nder des Sonnensystems.</p>
                        <p>Im August 2262 unternahm die Goodman, ein Frachtschiff vom Typ IV mit einer achtk&ouml;pfigen Besatzung, eine Routineversorgung einer Orbitalplattform bei Neptun. Ungef&auml;hr drei Stunden vor dem Ziel zerst&ouml;rte ein St&uuml;ck Weltraumschrott den Steuerbordantrieb und brachte das Schiff vom Kurs ab.</p>
                        <p>Die Goodman trieb mehrere Stunden, bevor die Crew es schaffte, sie zu reparieren. Was als n&auml;chstes geschah, wurde von den gr&ouml;&szlig;ten Wissenschaftlern der Welt untersucht &ndash; denn das Schiff verschwand spurlos. Untersuchungen der letzten bekannten Position ergaben keine Tr&uuml;mmer, nichts. Die Goodman ist einfach verschwunden.</p>
                        <!--[if lt IE 9]><script>document.createElement('audio');</script><![endif]-->
                        <audio class="wp-audio-shortcode" id="audio-31782-1" preload="none" style="width: 100%;" controls="controls"><source type="audio/ogg" src="https://robertsspaceindustries.com/media/vbjjy7liyz02tr/source/Time_capsule22626.ogg?_=1"></source><a href="https://robertsspaceindustries.com/media/vbjjy7liyz02tr/source/Time_capsule22626.ogg"></a>https://robertsspaceindustries.com/media/vbjjy7liyz02tr/source/Time_capsule22626.ogg</a></audio><p>In den n&auml;chsten Monaten verschwanden zwei weitere Schiffe in der gleichen Gegend auf &auml;hnliche Weise. Weitere Untersuchungen wurden eingeleitet, aber auch sie konnten nicht feststellen, was geschah. Schlie&szlig;lich wurde das Gebiet zur Flugverbotszone erkl&auml;rt.</p>
                        <hr id="2271"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/z1nx2luy4qkq5r/post_section_header/TimeCapsuleMag_FICrop.jpg"/></h6>
                        <h6><strong>2271: Ein kleiner Sprung f&uuml;r einen Menschen</strong></h6>
                        <p>JUMPER R&uuml;ckblick<br>
                        US/Farbe/123min<br>
                        Von Kevin Lazarus</p>
                        <p>Als Global/Nexus im vergangenen Jahr ank&uuml;ndigte, dass es ein weiteres Biopic &uuml;ber den ber&uuml;hmten Astro-Pionier Nick Croshaw ver&ouml;ffentlichen w&uuml;rde, schien es zu absurd. Jeder kennt schlie&szlig;lich seine Geschichte &ndash; von seiner unnachgiebigen Erforschung der Raumanomalie, die Schiffe ganz zu verschlingen schien, bis hin zum ersten Mann, der einen Sprungpunkt entdeckt und erfolgreich hindurch navigiert hatte. Wir haben es auf Video gesehen, es wurde besungen, ich bin sicher, dass es jemand gemalt hat, aber diese Sache hier &hellip; diese ist nun wirklich au&szlig;ergew&ouml;hnlich.</p>
                        <p>Mit einem Drehbuch des Newcomers Thomas Goss konnten die Produzenten Talente wie Michael Forbe (Croshaw) und Lima Hannigan (Baxter) und Regisseur Ariel Kalil (Requiem&rsquo;s Run) gewinnen. Es hatte zuvor schon viele Versuche gegeben, diese Geschichte zu erz&auml;hlen. Nun aber wurde ihr echte Lebendigkeit eingehaucht. Diese Periode von Croshaws Leben bestand zu gro&szlig;em Teil schlie&szlig;lich aus Versuch und Irrtum. Er versuchte zu verstehen, was die Anomalie verursachte und wie man sie dazu brachte, sich zu &ouml;ffnen. Dies ist ziemlich trockener Stoff, der viel mit Astrophysik und mit Falten in Raum und Zeit zu tun hat. Die Macher des Films haben es nun soweit heruntergebrochen, dass es f&uuml;r jeden zug&auml;nglich wird, um die Zuschauer emotional einzubinden, ohne jedoch die intellektuell herausfordernden Aspekte des Themas zu vernachl&auml;ssigen.</p>
                        <p>Nachdem es Croshaw gelungen war, die Anomalie zum ersten Mal zu durchqueren, wird der Film zu einer konventionellen Abenteuergeschichte, die rasch auf ihren H&ouml;hepunkt zusteuert. Jeder kennt die Gefahren der Navigation durch einen Sprungpunkt. Es ist, als w&uuml;rde man durch ein Asteroidenfeld mit Nachbrennern fliegen. Jetzt k&ouml;nnen wir im Film nacherleben, wie es sich anf&uuml;hlen muss: die blendenden Geschwindigkeiten, der Schrecken, aber auch der Rausch sowie das wahnsinnige Hochgef&uuml;hl des Gleitens an den Rand und schlie&szlig;lich das Herauskommen auf der anderen Seite.</p>
                        <p>Die Bilder, sobald Croshaw auf der anderen Seite des Sprungpunktes herauskommt, sind tadellos gemacht. Wir alle kennen heute das Croshaw-System und k&ouml;nnen durch den Film somit nachf&uuml;hlen, was Croshaw empfunden haben muss, als er es das erste Mal sah.</p>
                        <p>Der Film ist auf der ganzen Linie erstklassig. William Kurtz&rsquo; Musik ist mitrei&szlig;end und intim zugleich. Der Film wird viele ansprechen, obwohl Kinder die Wissenschaftssprache wahrscheinlich nicht m&ouml;gen werden. Erh&auml;ltlich f&uuml;r DVD und Stream ab dieser Woche, es gelten die Standard Upload- und Download-Kosten.</p>
                        <hr id="2380"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/zgu4wzxxdsxeqr/post_section_header/UNE_SampleImage3_FI.jpg"/></h6>
                        <h6>2380: Gemeinsam steigen wir auf</h6>
                        <p>Die Menschheit schien sich sicher und bequem in die Zukunft zu entwickeln. Planeten im Croshaw-System wurden sowohl f&uuml;r die Besiedlung als auch f&uuml;r die Ausbeutung von Ressourcen terraformt. Drei neue Sprungpunkte wurden entdeckt, zwei in Croshaw, einer in unserem eigenen Sonnensystem, so dass die M&ouml;glichkeit, in noch mehr Systeme zu expandieren, bald Realit&auml;t wurde. Die Regierungschefs aus aller Welt kamen zu einem Weltgipfel zusammen, um die n&auml;chste Phase der globalen Initiativen im Weltraum und auf der Erde zu diskutieren. Niemand wusste, dass dies zu einer neuen Richtung f&uuml;r die gesamte Menschheit f&uuml;hren w&uuml;rde&hellip;.</p>
                        <p><span style="color: #ffffff;"><em>LRO NewsDiv Abschriften</em></span></p>
                        <p><span style="color: #ffffff;"><strong><em>4.23.80, 6:05 CSET</em></strong></span></p>
                        <p><span style="color: #ffffff;">Angela Brevot: Es ist Woche zwei des Weltgipfels, und es gibt Ger&uuml;chte, dass sie sich auf eine gro&szlig;e Ank&uuml;ndigung vorbereiten. Niemand hat auch nur eine Ahnung davon, worum es bei dieser Ank&uuml;ndigunga geht. Ein Analyst spekuliert, dass die Ank&uuml;ndigung wahrscheinlich nur ein Trick ist, um die Medien dazuzubringen, weiter &uuml;ber den Gipfel zu berichten. So stellen sich die NewsOrg-Crews jeden Tag um 18 Uhr im Zuschauerraum auf und warten, ohne zu wissen, ob es eine Ank&uuml;ndigung geben wird oder nicht. Das geht jetzt schon seit acht Tagen so.</span></p>
                        <p><span style="color: #ffffff;"><strong>4.23.80, 6:28 CSET</strong></span></p>
                        <p><span style="color: #ffffff;">Angela Brevot: Vor etwa drei&szlig;ig Sekunden betrat ein Assistent den Zuschauerraum und holte die Crews von NewsOrg ab. Er f&uuml;hrt uns irgendwo tiefer in den Komplex hinein. Vielleicht ist die Ank&uuml;ndigung doch kein Werbegag. Wie Sie sehen k&ouml;nnen, werden wir in die&hellip;.da ist die Generalversammlung. Alle Delegierten aller Regierungen der Welt sind noch hier. Was ist hier los?</span></p>
                        <p><span style="color: #ffffff;"><strong><img class="alignright" src="https://robertsspaceindustries.com/media/vftuaa1qtefrjr/post/UNE_SampleImage3.jpg"/>4.23.80, 6:42 CSET<br></strong></span></p>
                        <p><span style="color: #ffffff;">[DELEGIERTER IVAN TSANG IST AUF DEM PODIUM, FLANKIERT VON VERTRETERN DER GLOBALEN SUPERM&Auml;CHTE]</span></p>
                        <p><span style="color: #ffffff;">Ivan Tsang: Vielen Dank f&uuml;r Ihre Geduld. Wenn alle bitte anfangen k&ouml;nnen zu senden, werden wir anfangen.</span></p>
                        <p><span style="color: #ffffff;">(Pause)</span></p>
                        <p><span style="color: #ffffff;">Guten Abend. Es ist eine aufregende Zeit in der Geschichte der Menschheit. Wir stehen an der Schwelle zu einer neuen &Auml;ra, in der die Erforschung und Kolonisierung des Weltraums nicht nur eine M&ouml;glichkeit, sondern eine Gewissheit ist. Fortschritte in der Terraforming-Technologie und im Astro-Design lassen uns immer weiter hinaus in den Kosmos reisen. Wissenschaftler haben im Croshaw-System ein paar Sprungpunkte entdeckt, die uns, wenn sie einmal durchquert sind, noch mehr Planeten und Systeme &ouml;ffnen werden, die wir erforschen k&ouml;nnen.</span></p>
                        <p><span style="color: #ffffff;">Ziel dieses Gipfels war es, eine Frage zu stellen. Es war nicht, wo gehen wir von hier aus hin? Es war, wie gehen wir dort hin? Eine Expansion auf dieser Ebene kann nicht mit konkurrierenden nationalen, politischen und sogar kommerziellen Interessen gelingen. Unsere pers&ouml;nlichen Streitigkeiten scheinen unbedeutend angesichts der Weite des Raumes, der vor uns liegt.</span></p>
                        <p><span style="color: #ffffff;">Deshalb sind die Vertreter der Erde auf diesem Gipfel zusammengekommen. Wir haben debattiert und diskutiert und sind nun zu dem Schluss gekommen, dass wir, wenn wir in den Weltraum aufbrechen wollen, dies als eine einzige, einheitliche Rasse tun m&uuml;ssen. Deshalb k&uuml;ndigen wir die Absicht an, f&uuml;r diesen und alle Planeten ein einziges Leitungsgremium zu bilden.</span></p>
                        <p><span style="color: #ffffff;">Dies sind die Vereinten Nationen der Erde.</span></p>
                        <p><span style="color: #ffffff;">Jeder der Regierungschefs vor Ihnen wird mit einem Referendum in sein Land zur&uuml;ckkehren. Es liegt noch viel Arbeit vor uns. Es gibt viele Probleme, die es zu l&ouml;sen gilt. Wir haben einen langen Weg vor uns, um eine stabile, funktionierende Regierung dieser Gr&ouml;&szlig;enordnung aufzubauen. Aber wissen Sie, wir werden es schaffen. Wir werden fair sein. Wir werden vereint sein. Danke und gute Nacht.</span></p>
                        <p>In den n&auml;chsten Jahren diskutierten die L&auml;nder unter- und miteinander. Obwohl es nur wenige zugaben, wusste doch jeder, dass ein Aufbruch ins All im Alleingang nicht m&ouml;glich war. Erst als die globalen Superm&auml;chte begannen, sich f&uuml;r die UNE zu engagieren, begannen die &uuml;brigen L&auml;nder, diesem Beispiel zu folgen. Die Menschheit hatte immer noch ihre Auseinandersetzungen, aber als es nun um das Universum ging, war sie vereint.</p>
                        <hr id="2438"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/pg0ekw65z740rr/post_section_header/FirstConNews_FI_crop.jpg"/></h6>
                        <h6>2438: Hallo</h6>
                        <p>United Times/Tribune NewsOrg Archiv<br>
                        Zuerst geplant: 12. Juni 2438<br>
                        Von Shelley-Feld</p>
                        <p>Seit wir ins Universum aufgebrochen sind, f&uuml;hlten wir uns schrecklich allein. Trotz der Entdeckungen der Sprungpunkte, trotz neuer Sternensysteme, f&uuml;hlt es sich schrecklich einsam an in der unendlichen Leere. Doch jetzt &auml;ndert sich alles. Denn jetzt wissen wir es.</p>
                        <p>Um ca. 3:13 SET suchte Vernon Tar, ein sechsunddrei&szlig;ig Jahre alter Explorer, nach unentdeckten Sprungpunkten im Davien-Syste. Er trieb durch die stille Schw&auml;rze, lediglich begleitet durch das Brummen seiner Tiefenscanner, als er pl&ouml;tzlich einen Treffer hatte.</p>
                        <p>&bdquo;Wenn du so lange in der Stille unterwegs bist, erschreckt dich jede Art von Ping&rdquo;, sagte Tar &uuml;ber DataCom, &ldquo;also &uuml;berpr&uuml;fte ich mein Display und, naja, es war kein Sprungpunkt.&rdquo;</p>
                        <p>Es war ein Schiff.</p>
                        <p>Urspr&uuml;nglich dachte er, es sei nur ein weiterer Explorer oder ein verlorenes Schiff, schlie&szlig;lich erkannte er es kaum.</p>
                        <p>&bdquo;Ich wollte es mir fast nicht ansehen. Ich war mir sicher, dass es ein anderer Jumper hier drau&szlig;en war, der dasselbe wie ich suchte.&rdquo; Erst als das Schiff n&auml;her kam, wurde ihm klar, was er sah: das erste Mitglied einer fremden Rasse. &bdquo;Nachdem ich meinen Schock &uuml;berwunden hatte, wusste ich, dass es eine heikle Situation war. Und so haben wir uns erst einmal nur eine Weile angestarrt.&rdquo;</p>
                        <p>Tar kontaktierte die UNE SOC und gab seine Koordinaten weiter. Eine Delegationspartei wurde zusammengestellt und eilte zum Treffpunkt. Milit&auml;rische Kr&auml;fte waren ebenfalls vor Ort, falls sie sich als feindlich erweisen sollten. Das Treffen dauerte etwa vierzig Minuten. Die UNE-Truppen mussten auf eine Antwort der Alien-Rasse warten.</p>
                        <p>Wissenschaftler sind derzeit dabei, Programme zur &Uuml;bersetzung und Kommunikation zu entwickeln, aber nach Jahrtausenden der Zivilisation k&ouml;nnen wir alle sagen, dass wir den Ersten Kontakt mit der Anmut und W&uuml;rde einer wirklich fortgeschrittenen Rasse gehandhabt haben. Von hier aus wissen wir jetzt mit Sicherheit, dass es eine andere Rasse gibt, eine andere Zivilisation, mit der wir teilen und wachsen k&ouml;nnen.</p>
                        <p>&nbsp;</p>
                        <p><em>Vorfallbericht<br></em><em>Eingereicht bei H-SOC Central<br></em><em>Autor: GEN Neal Socolovich 1<br></em><em>Nur autorisierte Benutzer<br></em><em>Re: &nbsp;Alien-Kontakt </em></p>
                        <p>Heute Nachmittag um 3 Uhr wurde der erste Kontakt mit einer fremden Zivilisation im Davien-System hergestellt. Hier ist ein &Uuml;berblick, was passiert ist: Vernon Tar suchte das System nach Sprungpunkten ab, als seine Systeme einen Kontakt aufnahmen. Er nahm an, dass es sich nur um einen weiteren Entdecker handelte. Er er&ouml;ffnete daher das Feuer, bevor er schlie&szlig;lich erkannte, dass es sich tats&auml;chlich um ein au&szlig;erirdisches Schiff handelte. Tar bekam Angst und meldete es. Wir isolierten die Kommunikation, um die Situation unter Kontrolle zu halten und eilten so schnell wie m&ouml;glich hinaus und setzten sofort das Standard-Eind&auml;mmungsprotokoll und die Mediensperre in Kraft.</p>
                        <p>So gut wir konnten, schien das Alien (nachher JERRY) ersch&uuml;ttert und ver&auml;rgert dar&uuml;ber zu sein, von Tar beschossen worden zu sein. Wir versuchten, Jerry mit Pantomimetechniken zu beruhigen. Au&szlig;erdem haben wir die TECH-Div benachrichtigt, um mit der Arbeit an einer Art Dolmetscherger&auml;t zu beginnen. Jerry lie&szlig; sie etwas von seiner Sprache aufnehmen. Wir haben auch fl&uuml;chtige Scans seines Schiffes durchgef&uuml;hrt. Wir haben zwar nichts Verd&auml;chtiges gefunden, aber die Daten sind beigef&uuml;gt.</p>
                        <p>Anschlie&szlig;end haben wir einige Informationen an die Presse weitergegeben und einen unserer Mitarbeiter f&uuml;r ein Interview mit Tar eingesetzt, um sicher zu stellen, dass er auf unserer Linie bleibt. &nbsp;Wir glauben nicht, dass Tar ein Problem sein wird. Wir erkl&auml;rten ihm, dass, wenn er schweigt, er der Held ist, der den ersten Kontakt hergestellt hat, und nicht der Idiot, der fast den ersten interstellaren Krieg ausl&ouml;ste. Tar verstand das sofort.</p>
                        <p>In der Zwischenzeit haben wir Scan-Arrays nach Davien geschickt, um die Augen offen zu halten, werden aber in den n&auml;chsten Tagen oder Wochen weitere Kontakte erwarten. Ich bin sicher, sie sind genauso neugierig wie wir.</p>
                        <p>Sie waren neugierig. Zwei Wochen sp&auml;ter erschien eine ausl&auml;ndische Delegation im Davien-System und nahm Kontakt mit Socolovich auf. In den n&auml;chsten Monaten arbeiteten die beiden Rassen daran, die Kommunikationsbarriere zu &uuml;berwinden. Als wir endlich miteinander interagieren konnten, erfuhren wir, dass sie die Banu waren &ndash; eine kollektive Rasse von Planetenstaaten, die auch gerade erst begonnen hatte, das Universum zu erforschen. Im Oktober 2438 unterzeichnete Socolovich und die anderen Delegierten das erste Interstellare Friedens- und Handelsabkommen mit den Banu.</p>
                        <hr id="2460"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/pgv3racue35kzr/post_section_header/OffWorldAd_1_Crop.jpg"/></h6>
                        <h6>2460: Frei atmen</h6>
                        <p>Die Erde ist &uuml;berf&uuml;llt.</p>
                        <p>Durch Expansion und Terraforming gibt es nun ein riesiges Territorium f&uuml;r die Menschheit, um sich auszubreiten, aber es gibt immer noch gro&szlig;e Vorbehalte in der &Ouml;ffentlichkeit. Erst mit der &ldquo;The Air You Breathe&rdquo;-Kampagne von RSI begannen die Menschen das Universum zu erobern.</p>
                        <p>Nachrichtenaustausch zwischen:</p>
                        <p>Mark Carl [Willet &amp; Ngo Werbung]
                        </p><p>Francois Kelsen[RSI, Corp]
                        </p><p>Re; Anzeigenkampagne</p>
                        <p>MC: Hey Francois, die Rechtsanw&auml;lte haben den Vertrag gecheckt und das Designteam hat die NDA&rsquo;s unterschrieben, sodass es so aussieht, als w&auml;ren wir im Gesch&auml;ft.</p>
                        <p>FK: Hervorragend. Wann k&ouml;nnen wir mit dem Brainstorming beginnen</p>
                        <p>MC: Wir stehen Ihnen jetzt zur Verf&uuml;gung. An welche Art von Kampagne haben Sie gedacht?</p>
                        <p>FK: Nun, ich wei&szlig; nicht. Sagen Sie es mir.</p>
                        <p>MC: Ich denke, wir spielen mit dem Gef&uuml;hl von Chancen. Die Erde wird immer die Erde sein, aber wir haben die Ressourcen ausgereizt.</p>
                        <p>FK: In der Tat.</p>
                        <p>MC: Sie gehen auf einen neuen Planeten. Die Luft wird sauberer&hellip;</p>
                        <p>FK: &hellip; alles ist neu. Ich meine, wann haben Sie das letzte Mal auf einem Feld gesessen?</p>
                        <p>MC: Einem echten?</p>
                        <p>FK: Sehen Sie, was ich meine?</p>
                        <p>MC: Es ist eine Chance. Die Chance auf eine Wiedergeburt. Darauf, neu anzufangen. Es geht um M&ouml;glichkeiten. Die Aufregung, nicht zu wissen, was einen erwartet.</p>
                        <p>FK: Aber ich will nicht, dass es so klingt, als w&auml;re es wild. Es gibt Zivilisation und Technologie.</p>
                        <p>MC: Richtig. Aber da ist noch Platz &hellip;</p>
                        <p>FK: Richtig. Ich will, dass die Leute verstehen, dass sie ein neues Leben haben k&ouml;nnen. Das bietet uns das Universum. Eine Chance, neu anzufangen. Und wir wollen ihnen die M&ouml;glichkeit geben, diese Chance zu nutzen.</p>
                        <hr id="2516"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/evn7ib2tza41kr/post_section_header/TerraFounded_4_FI_Crop.jpg"/></h6>
                        <h6>2516: &nbsp;Eine bessere Erde</h6>
                        <p>Bis zum Jahr 2516 war die UNE auf zw&ouml;lf Systeme angewachsen. W&auml;hrend Sprungpunkte und Datenrelais eine schnellere Reise zu den Systemen am Rande des erforschten Raums erm&ouml;glichten, begann die Erde sich ziemlich weit weg zu f&uuml;hlen. Wei-Yin Song, einer der f&uuml;hrenden Entdecker f&uuml;r das UNE-Projekt &bdquo;Far Star&ldquo;, stie&szlig; schlie&szlig;lich auf eine Entdeckung in einem neuen System und entwarf eine Botschaft mit einer interessanten Idee.</p>
                        <p><span style="color: #ffffff;"><em>An: UNE High Council<br></em><em>CC: General Kelso Trask, </em><em>Senatorin Patricia Oat<br></em><em>RE: K&Uuml;NFTIGES SYSTEM</em></span></p>
                        <p><span style="color: #ffffff;">Sehr geehrter Damen und Herren,</span></p>
                        <p><span style="color: #ffffff;">wie Sie wissen, ist es meine aktuelle Aufgabe, neue Systeme f&uuml;r zuk&uuml;nftiges Terraforming zu suchen und zu klassifizieren. Das neueste System (342A), das mein Team und ich entdeckt haben, befindet sich in einem Bereich, der als &bdquo;Zusammenfluss&ldquo;, als Nexus, bezeichnet werden kann. Wir haben bereits vier weitere Sprungpunkte entdeckt, zus&auml;tzlich zu dem, durch den wir hier ankamen und mit der M&ouml;glichkeit eines f&uuml;nften am Horizont.</span></p>
                        <p><span style="color: #ffffff;">Ich f&uuml;ge eine aktuelle Karte des betreffenden Systems mit den noch zu scannenden Zonen und den bereits entdeckten Sprungpunkten bei. Einer der Planeten (342A.03M) ist eine Super-Erde. Scans und Scouting-Missionen best&auml;tigten das Vorhandensein einer nat&uuml;rlich sauerstoffhaltigen Atmosph&auml;re, einheimischer Vegetation, riesiger Ozeane und gem&auml;&szlig;igter Klimata. Tief in der s&uuml;dlichen Region entdeckte ein Explorer-Team Reste einer besonderen Felsformation, die aussieht, als sei sie k&uuml;nstlich angeordnet worden. Wir haben aber aber noch keinen Hinweis auf intelligentes Leben gefunden.</span></p>
                        <p><span style="color: #ffffff;">Kurzum, ich m&ouml;chte vorschlagen, dass 342A.03M als Basis f&uuml;r das Terraforming und die Expansion in die angrenzenden Systeme eingerichtet wird. Das Team hat den Planeten Terra benannt, um seine &Auml;hnlichkeiten mit der Erde zu unterstreichen. Alle unsere aktuellen Daten und Erkenntnisse sind in diesem Comm-Paket enthalten.</span></p>
                        <p><span style="color: #ffffff;">Ich lade Sie ein, sich selbst davon zu &uuml;berzeugen.</span></p>
                        <p><span style="color: #ffffff;">Mit freundlichen Gr&uuml;&szlig;en,<br></span><span style="color: #ffffff;">Wei-Yin-Lied<br></span><span style="color: #ffffff;">Chefinspektor/Ingenieurin<br></span><span style="color: #ffffff;">Projekt Far Star</span></p>
                        <p>Der UNE-Kongress billigte den Plan, die Operationen des Ostsystems von Terra aus zu zentralisieren. Im Laufe der Jahre wuchsen die St&auml;dte und es entstand eine neue Kultur.</p>
                        <hr id="2523"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/6wvy8xmjh2cscr/post_section_header/ShowdownPanel1_Size_FI.jpg"/></h6>
                        <h6>2523: Die drei S&auml;ulen</h6>
                        <p><img class="alignright" src="https://robertsspaceindustries.com/media/ufrqtn2slol44r/post/ShowdownPanel2.jpg"/>ANSAGER: Willkommen zur&uuml;ck zur hei&szlig;esten Sendung &uuml;ber aktuelle Themen auf dem Spectrum. Mit unserem Panel, Kyle Black, Politologe, Sheldi Chen, Bestsellerautor und Sprecher, und Ben Feller, Futurist. Es ist Zeit f&uuml;r ein weiteres &hellip; SHOWDOWN!</p>
                        <p>KYLE: Also reden wir &uuml;ber diese neue Bombe der UNE, sie werde sich umstrukturieren&hellip;. was ist das jetzt wieder? UPE?</p>
                        <p>BEN: Vereinigte Planeten der Erde.</p>
                        <p>SHELD: Was f&uuml;r ein l&auml;cherlicher Name.</p>
                        <p>BEN: Kommen Sie schon. Es macht absolut Sinn. Wir haben ein paar dutzend Planeten, die sich erdumspannenden Populationen n&auml;hern, mit mehr am Horizont. Diese Menschen m&uuml;ssen vertreten sein. Und ernsthaft, die Vereinten Nationen der Erde sind etwas &uuml;berholt.</p>
                        <p>KYLE: Nach allem, was wir sagen k&ouml;nnen, und sie haben ein f&uuml;nfzehnhundertseitiges Dossier ver&ouml;ffentlicht, das die &Auml;nderungen umrei&szlig;t, sieht so aus, als ob das Setup ziemlich das gleiche ist.</p>
                        <p>BEN: Es ist mehr als das. Der Kongress wird sich nun aus Delegierten zusammensetzen, die die Planeten und nicht mehr die alten, veralteten Nationen vertreten. Es ist ein besseres System.</p>
                        <p>KYLE: Was halten Sie von diesen neuen Aush&auml;ngeschildern; ein Hoher Sekret&auml;r, der die Infrastruktur verwaltet, ein Hoher General f&uuml;r das Milit&auml;r und ein Hoher Anwalt f&uuml;r das Recht?</p>
                        <p>BEN: Wenn eine Regierung die schiere Anzahl von W&auml;hlern verwalten muss, die &ndash;</p>
                        <p>SHELD: Klingt nach einer tollen Einrichtung f&uuml;r den Faschismus.</p>
                        <p>BEN: Ist das Ihr Ernst?</p>
                        <p>SHELD: Jedes Mal, wenn du die Macht von den vielen in die H&auml;nde einiger weniger konzentrierst, wird jemand lernen, sie zu missbrauchen. Und au&szlig;erdem, wie zum Teufel hat Robert Thorn es geschafft, High Advocate zu werden? Der Mann ist ein Idiot und sollte von einem nicht bef&ouml;rderten Mob aus dem Amt geworfen werden. Er ist nicht mal ein B&uuml;rger.</p>
                        <p>KYLE: Oh, stopp, es wurde immer wieder bewiesen, dass er-</p>
                        <p>SHELD: Seine Akte k&ouml;nnte manipuliert worden sein. Haben Sie eine Ahnung, wie einfach das ist?</p>
                        <p>KYLE: Sehen Sie, wenn es so einfach ist, in DataBanks einzubrechen, dann ist die Staatsb&uuml;rgerschaft aller verd&auml;chtig. Wie kann ich zum Beispiel wirklich wissen, dass Sie ein B&uuml;rger sind?</p>
                        <p>SHELD: Hey, ich habe meine Zeit in der Air Force verbracht und zweimal den notwendigen Zivildienst geleistet, um meine Staatsb&uuml;rgerschaft zu verdienen. Schlagen Sie es nach, Sie &lt;Piep&gt;</p>
                        <p>BEN: Richtig, Ihre Eltern haben &uuml;berhaupt nichts beigetragen&hellip;.</p>
                        <p>SHELD: Halten Sie Ihren &lt;Piep&gt; Mund.</p>
                        <p>BEN: Sie &lt;PIEP&gt;</p>
                        <p>ANSAGER: Bleiben Sie in der N&auml;he f&uuml;r mehr SHOWDOWN! Nach diesen lokalen Werbespots.</p>
                        <hr id="2530"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/dsw8613apxkqrr/post_section_header/SubCommittee_FI_2_Crop.jpg"/></h6>
                        <h6>2530: Die Galaxie wird gr&ouml;&szlig;er</h6>
                        <p>Es war wie einst beim Goldrausch auf der Erde. Die &bdquo;planetarischen Goldsucher&ldquo; verzweifelten daran, ihren Anspruch auf nicht terraformten Welten durchzusetzen. Die meisten folgten den Anweisungen der Regierungen, andere nicht.</p>
                        <p>Gaia Planet Services etwa versuchte, einen Planeten ohne Genehmigung zu terraformen. Dabei stellte sich heraus, dass der Planet nicht unbewohnt war. Eine neue Rasse, die sp&auml;ter als das Xi&rsquo;An Imperium bezeichnet werden w&uuml;rde, tauchte pl&ouml;tzlich auf, w&auml;hrend die Terraformer ihre Arbeit aufnahmen. Unn&ouml;tig zu sagen, dass sie etwas beunruhigt waren. Die Xi&rsquo;An nahmen die gesamte Crew gefangen. Einen, den Vorarbeiter Charles Baxter, lie&szlig;en sie als Geste des guten Willens schlie&szlig;lich frei.</p>
                        <p>Auf der Erde versammelten sich unterdessen High-Secretary Cho, High-General Volder und High-Advocate Machado mit einem ausgew&auml;hlten Unterausschuss der Senatoren, um eine klare Einsch&auml;tzung dar&uuml;ber zu erhalten, was geschehen und wie mit dem Xi&rsquo;An zu verfahren war.</p>
                        <p>HIGH-SECRETARY CHO: Wenn alle bereit sind &hellip; Mr. Baxter, beginnen Sie bitte. Erz&auml;hlen Sie uns von den Ereignissen dieses Tages.</p>
                        <p>BAXTER: Ich wurde vom Anwalt der Firma beraten, dass ich&hellip;</p>
                        <p>HIGH-ADVOCATE MACHADO: Herr Baxter, dies ist keine strafrechtliche Verhandlung. Wir versuchen einfach, ein klares Bild davon zu bekommen, was passiert ist. Es gibt immer noch zweihundertf&uuml;nfundsiebzig Ihrer Kollegen, die von einer fremden Zivilisation festgehalten werden. Jede Hilfe, die Sie uns heute geben, wird ber&uuml;cksichtigt werden, wenn die Krise gel&ouml;st ist.</p>
                        [Baxter konferiert mit seinem Anwalt]
                        <p>BAXTER: Wir haben nach Baugrund gesucht, um die Ausr&uuml;stung aufzustellen. Es waren drei Transporte hinab auf den Planeten geplant, sodass wir erwarteten, bald Schiffe zu h&ouml;ren. Ich war auf einem Bergr&uuml;cken, als das erste Schiff in Sicht kam. Ich wusste sofort, dass es nicht unseres war. Menschlich, meine ich. Es sah aber auch nicht wie ein Banu-Schiff aus. Sie wissen ja&hellip;</p>
                        <p>HIGH-SECRETARY CHO: Bitte bleiben Sie beim Thema.</p>
                        <p>BAXTER: Nun, das n&auml;chste, was wir wussten, war, dass sie &uuml;berall um uns herum waren. Schiffe tauchten pl&ouml;tzlich aus allen m&ouml;glichen Richtungen auf.</p>
                        <p>HIGH-GENERAL VOLDER: Haben Sie keine Scans vor der Landung gemacht?</p>
                        <p>BAXTER: Nicht wirklich. Ich meine, ich glaube nicht.</p>
                        <p>HIGH-GENERAL VOLDER: Denken Sie nicht, dass das klug w&auml;re, bevor Sie versuchen, einen Planeten zu terraformen?</p>
                        <p>BAXTER: Sie wissen nicht, wie es da drau&szlig;en ist. Wenn man zu lange wartet, kommt eine andere Corp und baut die Mineralien ab &ndash; und zwar schneller ab, als man blinzeln kann.</p>
                        <p>HIGH-GENERAL VOLDER: Wir sch&auml;tzen Ihre soziologische Sicht durchaus, Mr. Baxter. Aber wir brauchen Fakten, keine &Uuml;bertreibung, wenn wir die Geiseln befreien wollen.</p>
                        <p>HIGH-SECRETARY CHO: General, wir sind noch nicht zu dem Schluss gekommen, dass eine Milit&auml;raktion notwendig ist.</p>
                        <p>HIGH-GENERAL VOLDER: Ich verstehe, aber wir m&uuml;ssen einen Plan haben, nachdem wir handeln k&ouml;nnen, falls die diplomatischen L&ouml;sungen nicht fruchten.</p>
                        <p>HIGH-SECRETARY CHO: Einverstanden. Fahren Sie fort, Mr. Baxter.</p>
                        <p>&hellip;ENDE EXCERPT</p>
                        <p>Die UPE-Milit&auml;rs errichteten eine Sperrzone rund um den Sprungpunkt. Es dauerte f&uuml;nfzehn Tage, um ein Kommunikationssystem zu entwickeln, um mit den Xi&rsquo;An zu sprechen. Damit begann eine angespannte Verhandlungsphase. Die Xi&rsquo;An waren sehr akribisch in ihren Forderungen. Als die Geiseln freigelassen wurden, waren mehr als siebenundf&uuml;nfzig Tage vergangen. Obwohl die UPE es geschafft hatte, einen Krieg zu vermeiden, blieben die Beziehungen zu den Xi&rsquo;An angespannt.</p>
                        <hr id="2541"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/3j8r3zp2woul5r/post_section_header/MesserProp_4_FI.jpg"/></h6>
                        <h6>2541: Es ist schrecklich voll in meinem Himmel</h6>
                        <p><img class="alignright size-medium wp-image-31784" src="https://starcitizenbase.de/wp-content/uploads/2018/07/MesserProp_4-193x300.jpg" alt="MesserProp 4" width="193" height="300" data-wpmf_size_lightbox="large" data-wpmflightbox="1"> Da die UPE ihr k&uuml;hles Verh&auml;ltnis mit den Xi&rsquo;An in der N&auml;he von Terra im Osten des Empires aufrechterhielt, waren wir in den Systemen im Westen der Erde immer noch unangefochten. Das aber sollte sich bald &auml;ndern.</p>
                        <p>Die Tevarin lagen technologisch etwa hundert Jahre hinter den Menschen zur&uuml;ck. Sie brachen gerade erst von ihrer Heimatwelt Kaleeth auf. Der Tevarin hielten sich an ein starres Kriegerethos, das Pflicht und Treue als Tugenden ehrte. Sie waren keine blutr&uuml;nstige Spezies, sie ehrten einfach die Kunst des Kampfes.</p>
                        <p>UPE Systembezeichnung: Elysium<br>
                        Datum der Entdeckung: 15. November 2541<br>
                        Jump-Point NavDirections U/L: Kellar Lench[Pilot/n.C.]
                        </p><p>Systembewertung: Auf Elysium IV gibt es eine einheimische Art, die sich Tevarin nennt. Obwohl sie empfindsam und intelligent sind, haben sie sich technologisch nicht zu unserem Niveau entwickelt. Wir empfehlen, dass wir Kontakt aufnehmen und sie in die UPE eingliedern. Es ist eine wunderbare Gelegenheit, die Tevarin in unsere Zeit zu bringen.</p>
                        <p>Die UPE hat die Tevarin erreicht. Sie waren jedoch nicht daran interessiert, diplomatische Beziehungen einzugehen oder gar unsere Technologie anzunehmen. Sie waren lediglich an unseren Systemen interessiert. So begann der erste Interspezies-Krieg, wie die meisten Kriege begannen &ndash; n&auml;mlich als Auseinandersetzung um ein Territorium.</p>
                        <p>Als der Tevarin-Krieg zu schwellen begann, bef&uuml;rchtete das Milit&auml;r, dass der Konflikt im Westen einen Xi&rsquo;An-Angriff im Osten beg&uuml;nstigen und einen Angriff einleiten k&ouml;nnte. Gl&uuml;cklicherweise erregte ein junger und ehrgeiziger Offizier, Ivar Messer, &ouml;ffentliche Aufmerksamkeit, als er sich in der Schlacht von Idris IV. hervorhob. Die UPE erkannte dies schnell und machte Messer zum Gesicht des Tevarin-Krieges.</p>
                        <hr id="2546"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/e0chmjckscw3ir/post_section_header/MesserRise_2Crop.jpg"/></h6>
                        <h6>2546: Ein Anf&uuml;hrer erhebt sich</h6>
                        <p>Alyssa Jamali kam zu sp&auml;t. Sie war letzte Nacht am Tisch eingeschlafen, als sie an ihren Chemie-Hausaufgaben gearbeitet hatte. Jetzt musste sie ihre Poly-Sci-Aufgabe auf dem Weg zum Unterricht fertigstellen. Generaloberst Messer hatte bei einer Gedenkveranstaltung f&uuml;r die Opfer des Bombenanschlags auf Cestulus gesprochen und ihr Lehrer, Herr Kent, wollte eine einseitige Zusammenfassung der Rede.</p>
                        <p>Diktat-Start:<br>
                        Alyssa Jamali<br>
                        Politik-Wissenschaft/Kent/45Bcf<br>
                        Zuordnung: Messer Rede</p>
                        <p>Die Systeme fallen auseinander. Seit dem Ende des Krieges erleben wir eine neue Art der Bedrohung. Dieser Kampf wird jedoch nicht auf Schlachtfeldern oder zwischen Gro&szlig;kampfschiffen ausgetragen. Das war die Botschaft vor acht Monaten. Sechs Terroranschl&auml;ge allein im vergangenen Jahr hatten alle von der Vorstellung kuriert, dass die Niederlage der Tevarin zum Frieden f&uuml;hren w&uuml;rde. Die Leute wollten Antworten, aber vor allem wollten sie das Gef&uuml;hl haben, dass die Regierung die Kontrolle hatte. Sie bekamen weder das eine noch das andere.</p>
                        <p>Die Gerichtsbarkeit hat die T&auml;ter nie gefasst. Sie wusste nur, dass die Bomben zum Teil aus Xi&rsquo;An-Technologie hergestellt worden war. Unterdessen diskutierte die Regierung nun die passende Vorgehensweise &ndash; bis hin zur Unt&auml;tigkeit.</p>
                        <p>Also fielen die Systeme auseinander. Die Menschheit brauchte einen F&uuml;hrer. Die L&ouml;sung? Das Schaffen einer neuen Position, die des &bdquo;Prime Citizen&ldquo;, die entscheidende Stimme in einer &uuml;berforderten Regierung.</p>
                        <p>B&uuml;rger aller Systeme begannen, sich f&uuml;r dieses neue Amt zu bewerben. Jede Woche schien es, als w&uuml;rde ein neuer Kandidat die gleichen Versprechungen machen. Das ging monatelang so. Als die Wahl n&auml;her r&uuml;ckte, schlug Generaloberst Messer seinen Namen als Kandidat vor. Er sprach gestern Abend bei einer Gedenkfeier f&uuml;r die Opfer des vierten Terroranschlags.</p>
                        <p>&bdquo;Menschen. B&uuml;rger. Ich komme heute als Gl&auml;ubiger zu Ihnen. Ich glaube, dass wir eine gro&szlig;e und lebendige Geschichte haben. Ich glaube, dass es noch so viele weitere wunderbare Dinge im Universum zu entdecken gibt. Ich glaube an die Menschheit.</p>
                        <p>Aber es gibt Feinde, die uns vernichten wollen. Das vereitelt unseren Aufstieg. Unsere Feinde wollen, dass wir von den Sternen zur&uuml;ckfallen. Die b&ouml;sartigen Angriffe auf unsere Systeme sind nur der Anfang. Als Soldat, der den Schrecken des Krieges gesehen hat, sage ich das nicht leichtfertig. Wir m&uuml;ssen uns sch&uuml;tzen. Wir m&uuml;ssen unsere Familien besch&uuml;tzen. Unsere Zukunft. Unsere F&auml;higkeit, das einzufordern, was uns zusteht.</p>
                        <p>Ich will keinen weiteren Krieg. Zu viele S&ouml;hne und T&ouml;chter, Ehem&auml;nner und Ehefrauen sind bereits im tiefen Vakuum und auf unfruchtbaren Planeten verloren gegangen. Aber ich sage: Ich w&uuml;rde jedes System und jeden Sprungpunkt mit Schilden und einem tausend Kilometer dicken Draht ausr&uuml;sten, wenn wir daf&uuml;r nicht mehr Menschenleben verlieren w&uuml;rden.</p>
                        <p>Ich war schon immer ein Soldat der Menschheit. Gebt mir die Chance, Euch zu besch&uuml;tzen. Gebt mir die Chance, die Bedrohungen und die Gewalt von Spezies, die nicht so zivilisiert sind wie wir, von uns fern zu halten, damit wir unseren rechtm&auml;&szlig;igen Platz in der Galaxie einnehmen k&ouml;nnen.</p>
                        <p>Glaubt an mich, wie ich an Euch glaube. Glaubt an die Menschheit!&ldquo;</p>
                        <p>Generaloberst Messer sprach mit einer &Uuml;berzeugung, die es leicht machte, ihm zu glauben. Kurz gesagt: Ich denke, er hat Recht. Es gibt ein inh&auml;rentes Problem mit den drei Machtverh&auml;ltnissen. Es ist besser, diesen Diskurs in Friedenszeiten zu f&uuml;hren, wir leben aber nun einmal in einer gef&auml;hrlichen Zeit. Entscheidungen m&uuml;ssen manchmal schnell und effektiv getroffen werden. Ich wei&szlig;, das klingt wie der erste Schritt in Richtung Diktatur, aber unser Regierungssystem ist ja immer noch vorhanden. Die Methode, die sie vorschlagen, h&auml;lt immer noch den Hohen Sekret&auml;r, General und Gericht und sogar den Senat aufrecht, aber sie alle beraten den Prime Citizen, der dann die Entscheidung trifft.</p>
                        <p>Oder wie Generaloberst Messer nach seiner Bewerbung f&uuml;r das Amt des Prime Citizen sagte:</p>
                        <p>&bdquo;Jedes Schiff braucht einen Kapit&auml;n.&rdquo;</p>
                        <hr id="2610"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/lkgncbvb0gdgpr/post_section_header/AaronFring_artpiece.jpg"/></h6>
                        <h6>2610: Tr&auml;nen des Feuers</h6>
                        <p>Bentley Nationalgalerie<br>
                        Selbst-Tournee Malerei Info<br>
                        St&uuml;ck: &ldquo;Tr&auml;nen des Feuers&rdquo;<br>
                        K&uuml;nstler: Aaron Fring<br>
                        Erstellt: 2610</p>
                        <p><img class="alignright" src="https://robertsspaceindustries.com/media/35wkx6icwglmir/post/FringGallery3.jpg"/>Vor Ihnen steht eines der eindr&uuml;cklichsten Bilder aus dem Zweiten Tevarinkrieg (2603-2610). Es wurde im Jahr 2633 in das Archiv der UPE aufgenommen. Der K&uuml;nstler, Aaron Fring, wurde 2578 auf Ferron von Max und Mary Fring, einem Lehrer und einer Pilotin, geboren. Als Kind litt er unter einem Anfall von Kilos&rsquo; Krankheit und war &uuml;ber ein Jahr lang bettl&auml;gerig. W&auml;hrend dieser Zeit verbrachte er seine Zeit mit zeichnen. Als junger Mann trat Fring als Feldmediziner in die Expeditionsarmee ein. Er reiste zu vielen Systemen, bevor er sich schlie&szlig;lich entschied, sich auf Elysium IV niederzulassen.</p>
                        <p>Tags&uuml;ber betrieb Fring eine kleine Medizin-Station und begann nachts wieder zu malen. Oft war er stundenlang in der Landschaft unterwegs und malte alles, was er sah. W&auml;hrend er als Landschaftsk&uuml;nstler vielversprechend war, hinterlie&szlig; er nie einen gro&szlig;en Eindruck in der Kunstszene. Obwohl er sich mehr w&uuml;nschte, war Fring mit seiner Praxis und seinem Hobby zufrieden.</p>
                        <p>Im Jahre 2603 tauchte ein neuer Tevarin-Kriegsherr, Corath&rsquo;Thal, aus den Tiefen des Kosmos mit einer wiederaufgebauten Tevarin-Kampfflotte auf und startete seinen ersten Angriff gegen die UPE-Systeme. Die einzige Mission der Tevarin war es, Elysium IV, ihre ehemalige Heimatwelt, zur&uuml;ckzuerobern. Die Siedlungen auf Elysium IV eilten zu den Waffen, um ihre H&auml;user zu verteidigen. Fring versuchte sich anzuschlie&szlig;en, aber die gleiche Krankheit, die ihn als Kind geplagt hatte, tauchte wieder auf und hinderte ihn daran, seine Pflicht zu tun.</p>
                        <p>Am 24. Juni 2610 SET erlitt Corath&rsquo;Thal bei der ber&uuml;chtigten Schlacht von Centauri eine katastrophale Niederlage durch die Squadron 42. Da die Schiffe seine Flotte schnell entweder zerst&ouml;rt oder aufgegeben wurden, brachte Corath&rsquo;Thal seine verbliebenen treuen Piloten zusammen, um Elysium IV in einem Akt der Verzweiflung anzugreifen. Obwohl sie weitere 70 Prozent Verluste erlitten, erreichte die Flotte schlie&szlig;lich die Atmosph&auml;re ihrer alten Heimatwelt.</p>
                        <p>Corath&rsquo;Thal und seine Piloten senkten absichtlich ihre Hitzeschilde und tauchten in die Atmosph&auml;re ein. Aaron Fring war an diesem Abend unterwegs. Die Symptome seiner Krankheit waren abgeklungen. Er wanderte durch die Landschaft, wie er es schon oft getan hatte. Auf dem Kamm eines H&uuml;gels sah er schlie&szlig;lich etwas Spektakul&auml;res: Die Tevarin-Flotte verbrannte in der Atmosph&auml;re, als sie zu Boden raste.</p>
                        <p>Aus der Kunst heute (2613):</p>
                        <p>&ldquo;Wie bei den meisten Kunstwerken habe ich nicht versucht, den Moment genau so darzustellen, wie er war. Das habe ich in der Vergangenheit immer getan, aber das war mehr als das Visuelle. Es gab so viel Komplexit&auml;t in diesem Moment. Ich wollte nur versuchen, das Gef&uuml;hl dieses Bruchteils der Zeit einzufangen. So sch&ouml;n und so traurig.&rdquo;</p>
                        <p>Aaron Fring</p>
                        <hr id="2638"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/ogr4oanxxt17yr/post_section_header/SovereigntyFI_1_Crop.jpg"/></h6>
                        <h6>2638: Aufruf zur Unabh&auml;ngigkeit</h6>
                        <p>Terra Gazette &ndash; Ausgabe 3.12.38<br>
                        Terra Gouverneur entwirft Gesetzentwurf f&uuml;r Terraner Souver&auml;nit&auml;t<br>
                        Von Viola F&uuml;ller</p>
                        <p>Eine politische Kundgebung f&uuml;r die Wiederwahl des B&uuml;rgermeisters von New Benzi, Nadir Padwani, f&ouml;rderte einen erstaunlichen neuen Vorschlag zu Tage. Es war Abendd&auml;mmerung und die Spendensammlung machte Fortschritte, als Assan Kieren auf das Podium stieg. Nur wenige wussten, dass er im Begriff war, eine sprichw&ouml;rtliche Bombe zu z&uuml;nden.</p>
                        <p>Um ca. 5:15 Uhr Ortszeit enth&uuml;llte Assan Kieren Pl&auml;ne, ein Referendum f&uuml;r die Bev&ouml;lkerung von Terra und die benachbarten Systeme zu fordern, um die Unabh&auml;ngigkeit von Imperator und UEE zu erreichen.</p>
                        <p>&bdquo;Der Imperator lebt in einer Zeit, in der au&szlig;erirdische Zivilisationen etwas sind, dass man f&uuml;rchten muss. Diejenigen von uns, die hier leben, wo die Banu und Xi&rsquo;An Nachbarn sind, wo wir sie jeden Tag sehen, wissen jedoch, dass sie nicht der Feind sind. Sie sind Wesen wie wir, ihre Kultur kann anders sein, ihre Motivation kann anders sein, aber sie versuchen nur sicher zu leben. Der Imperator h&auml;lt sie gerne auf Distanz, aber ich glaube nicht, dass wir diesen Weg weiter gehen sollten. Wie Carson einmal sagte: &bdquo;Wenn du einen Krieg vorwegnimmst, wirst du fr&uuml;her oder sp&auml;ter einen haben.&rdquo; Kurz gesagt, ich glaube, dass sich die Erde zunehmend von den Realit&auml;ten der heutigen Zeit verabschiedet hat, dass sie stattdessen politische und soziale Instabilit&auml;t in allen Systemen verursacht. Das ist kein Aufruf zu Waffen und keine Einladung zu Konflikten. Alles, worum ich bitte, ist, einen Dialog zu er&ouml;ffnen.&rdquo;</p>
                        <p>Unn&ouml;tig zu sagen, dass anschlie&szlig;end nicht mehr viele Leute &uuml;ber die Wiederwahl des B&uuml;rgermeisters sprachen&hellip;.</p>
                        <p>(Fortsetzung)</p>
                        <p>United/Tribune NewsOrg -5.4.38 Ausgabe<br>
                        Terras aufr&uuml;hrerischer Gesetzentwurf scheitert<br>
                        Von Raymond-Rolle</p>
                        <p>Der Antrag auf Separation des ber&uuml;chtigten terranischen Gouverneurs Assan Kieren hat heute das &ouml;ffentliche Referendum nicht bestanden. Wie erwartet, erkannten die treuen B&uuml;rger von Terra und seinen Nachbarsystemen, dass Kierens Plan f&uuml;r die Souver&auml;nit&auml;t eine schlecht durchdachte, unrealistische Idee war, die zu einer instabilen Zukunft f&uuml;r sie und ihre Kinder f&uuml;hren w&uuml;rde. Sie gingen in Scharen zu den Wahllokalen und sagten: Nein. Wir sind nicht einverstanden. Wir glauben nicht, dass die UEE uns im Stich l&auml;sst. Man kann nur hoffen, dass Kieren die Botschaft bekommt.</p>
                        <p>Terra Gazette &ndash; Ausgabe 9.24.38<br>
                        Gouverneur von Skandal geplagt<br>
                        Von Viola F&uuml;ller</p>
                        <p>Egal, wohin sich Assan Kieren zu wenden scheint, stets hagelt es neue Vorw&uuml;rfe. Seit seinem Antrag auf Souver&auml;nit&auml;t vor sechs Monaten musste der Gouverneur Vorw&uuml;rfe von Untreue &uuml;ber Drogenabh&auml;ngigkeit bis hin zu Korruption entkr&auml;ften. Heute ver&ouml;ffentlichte der Gouverneur eine Erkl&auml;rung an alle NewsOrgs.</p>
                        <p>&bdquo;All diese Behauptungen sind unbegr&uuml;ndet und versuchen einfach, vom eigentlichen Problem abzulenken. Der Imperator und seine Gefolgsleute haben die Autorit&auml;t der Regierung zerst&ouml;rt, indem sie den klaren Willen des Volkes ignoriert haben, sich von einer korrupten und abscheulichen Regierung zu emanzipieren.&rdquo;</p>
                        <p>Kieren erkl&auml;rte weiter, dass er Beweise f&uuml;r Manipulationen und Betrug durch Mitarbeiter auf der Gehaltsliste der UEE erhalten hat. Diese Beweise wurden in das laufende Verfahren aufgenommen und werden nun Teil seines laufenden Bundesverfahrens gegen Imperator Messer III sein.</p>
                        <p>Terra Gazette &ndash; 11.4.38 Ausgabe<br>
                        Xi&rsquo;An/Human Terrorist Network enth&uuml;llt<br>
                        Von Raymond-Rolle</p>
                        <p>Der Feind ist unter uns! Am fr&uuml;hen Morgen k&uuml;ndigten Advocacy Agents die Aufl&ouml;sung einer massiven, beh&ouml;rden&uuml;bergreifenden Undercover-Operation an. Es gab dutzende Verhaftungen, weitere stehen aus. Unbenannte Quellen innerhalb der Regierung behaupten, dass die Xi&rsquo;An-finanzierten Terroristen verschiedene Positionen in Regierungs- und Corp-Strukturen infiltriert h&auml;tten. W&auml;hrend wir noch auf eine offizielle Erkl&auml;rung warten, haben uns mehrere Quellen best&auml;tigt, dass der ehemalige Gouverneur von Terra, Assan Kieren, beteiligt sein k&ouml;nnte. Der gleiche Gouverneur, sofern Sie sich erinnern, der verschwand, nachdem die B&uuml;rger ihn nach seinen verzweifelten und paranoiden Versuchen, Unordnung und Anarchie in die Systeme zu bringen, aus dem Amt vertrieben hatten.</p>
                        <hr id="2681"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/uftv86ajk6nenr/post_section_header/VanduulRaidScreenGrab3b.jpg"/></h6>
                        <h6>2681: Verbrannte Erde</h6>
                        <p>Im Westen, im Orion-System, bricht die Kommunikation zu einer kleinen Siedlung pl&ouml;tzlich ab. Es dauert Wochen, bevor jemand daran denkt, nachzuforschen. Sie finden schlie&szlig;lich ein Township in Asche und die Advocacy entsendet sofort einen Agenten zur Untersuchung.</p>
                        <p>EREIGNISBEWERTUNG<br>
                        Standort: Dell Township/Wasserreinigung Siedlung/Armitage Planet/Orion System<br>
                        SAIC: Rhedon Lamr</p>
                        <p>Die ersten Bilder deuten auf wiederholte Angriffe der Luftwaffe mit mehreren, vermutlich kleinen Schiffen hin. Kein offensichtlicher Einsatz von gro&szlig;kalibrigen Waffen oder Bomben. Brandspuren am &ouml;stlichen und s&uuml;dwestlichen Stadtrand deuten darauf hin, dass die Angreifer wahrscheinlich dort gelandet sind. Wir haben Proben von verbrannter Erde zur Analyse ins Labor geschickt. Die Winkel der abgegebenen Sch&uuml;sse best&auml;tigen die Theorie, dass die Angriffe aus mehreren Richtungen kamen. Der Comm-Tower wurde besch&auml;digt. Es sah aber nicht gezielt aus. Seltsam. Wenn es Raider gewesen w&auml;ren, w&auml;re nicht ihr erstes Ziel die Kommunikation?</p>
                        <p>Auf dem Boden fanden wir seltsame Patronenh&uuml;lsen, die in der ganzen Stadt verstreut waren. Sieht in der Herstellung nicht menschlich aus. Analyse folgt. Weiterleitung an Advocacy-Agenten mit Kontakten im Banu Protectorate.</p>
                        <p>Die Angreifer waren gr&uuml;ndlich und gingen von Haus zu Haus. Sie t&ouml;teten alles und jeden. Ganze sechshundertachtunddrei&szlig;ig Einwohner der Siedlung wurden umgebracht, au&szlig;er einer Persion: John Phillips, 38 Jahre alt. Ein Farmer. Unsere Analysten reden derzeit mit ihm. Wir liefern eine vollst&auml;ndige Datei, wenn wir alle Informationen haben.</p>
                        <p>Diebstahl und Raub scheinen die Hauptmotivation gewesen zu sein, aber es gibt eine Inkonsistenz bei den fehlenden Gegenst&auml;nden. Manchmal wurden Wertgegenst&auml;nde zur&uuml;ckgelassen, w&auml;hrend scheinbar nutzlose Gegenst&auml;nde mitgenommen wurden.</p>
                        <p>Agent Vasquez hat eine kleine CommLink-Kamera entdeckt, die w&auml;hrend des Angriffs alles aufgenommen hat. Ich habe das Filmmaterial durchgesehen, doch das meiste zeigt nichts Nennenswertes. Auf einem Bild jedoch sieht man offenbar kurz einen der Angreifer, wenn man nah heran zoomt.</p>
                        <hr id="2758"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/333cpe8yysuksr/post_section_header/NewspaperFixed2.jpg"/></h6>
                        <h6>2758: Nicht in Nottingham</h6>
                        <p>United/Tribune NewsOrg Archiv<br>
                        Ver&ouml;ffentlicht: 14. J&auml;nner 2758 SET<br>
                        Vanduul Attack!0<br>
                        Von Edward Coss</p>
                        <p>Die B&uuml;rger von Boro dachten, sie w&auml;ren bereit. Sie besa&szlig;en eine Orbitalverteidigung und Tiefraumscanner. Aber wenn eine Vanduul-Kriegsflotte zuschl&auml;gt, musst du mehr als bereit sein. Um 17:23 Uhr Ortszeit begann der Angriff. Gl&uuml;cklicherweise wurde sofort Alarm ausgel&ouml;st. Lokale Milizen aus der Umgebung des Systems bemannten ihre Schiffe, um die J&auml;ger zu verfolgen, aber erst als die UEE-Flotte eintraf, flohen die Vanduul zur&uuml;ck in die Dunkelheit des Weltraums. Der Vanduul-Angriff dauerte nur 27 Minuten. In dieser Zeit wurden vierzehn Seelen ausgel&ouml;scht und Millionen verloren ihr Eigentum.</p>
                        <hr id="2789"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/ne9m5g58mg450r/post_section_header/ShipBridge_1_FI.jpg"/></h6>
                        <h6>2789: Kalter Krieg</h6>
                        <p>UEE 33. Flotte, C-Wing, SS LightHammer<br>
                        XOS LOGBUCH &ndash; 5.29.2789</p>
                        <p><img class="alignright" src="https://robertsspaceindustries.com/media/2qzpg0gqngfvkr/post/ShipBridge_1.jpg"/>06:12: Officer&rsquo;s Meeting. Gingen die COMSEC-Updates der letzten sechs Stunden durch. Nichts Aufregendes. Bericht &uuml;ber Sch&uuml;sse auf eine Reaper-Klasse im Kieler System. Eine Deckkanone hat wegen eines Computerfehlers eine Fehlfunktion.</p>
                        <p>07:24: Zum Dienst gemeldet. Haben systemweite diagnostische Waffenchecks durchgef&uuml;hrt. Sind auf der ganzen Linie klar.</p>
                        <p>11:15 Uhr: Nills (Comms) klang, als w&uuml;rde er krank werden. Alles war ruhig, also schickte ich ihn auf die Krankenstation. Sein zweiter Offizier war ein guter Ersatz.</p>
                        <p>12:32 Uhr: Endlich etwas zu essen. Langeweile macht sich in der Crew breit. Manchen geht das Temperament durch. Werde mich an den Commander wenden und versuchen, L&ouml;sungen zu finden, um Stress abzubauen.</p>
                        <p>15:34 Uhr: Ich wei&szlig; nicht, wo ich anfangen soll. Ich arbeitete an der Bewertung meiner Kampfsimulation des Xi&rsquo;An-Tr&auml;gers, als Shaw mich auf die Neuigkeiten auf dem Spectrum aufmerksam machte. Offenbar hat Senator Akari von Terra unabh&auml;ngig einen Vertrag mit den Xi&rsquo;An ausgehandelt. Es soll um 19 Uhr in Kraft treten. Die Leute halten es f&uuml;r einen Witz. Vielleicht hat ein Aktivist die NewsOrgs geknackt? W&auml;re nicht das erste Mal. Wir k&ouml;nnen diesen Vertrag nicht einhalten, oder? Sollen wir Akari wegen Hochverrats verhaften? Die Nachricht w&uuml;rde die Erde tagelang nicht erreichen, also wusste niemand wissen, was zu tun ist. Ich war genauso verbl&uuml;fft wie alle anderen, also informierte ich den Kommandanten, der sich sofort auf der Br&uuml;cke meldete.</p>
                        <p>16:20: Alle fliegen immer noch blind. Alle Schiffe sind in h&ouml;chster Alarmbereitschaft. Auf der Suche nach jeder Art von Aggression. Bisher nichts. K&ouml;nnte ein Xi&rsquo;an-Trick sein.</p>
                        <p>19:02: Die Xi&rsquo;An Mirror riefen ihre J&auml;gerpatrouillen zur&uuml;ck, schalteten ihre Waffen aus und zogen sich zur&uuml;ck. Ich sch&auml;tze, wir sind nun im Frieden?</p>
                        <hr id="2792"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/s8vco7k88m19fr/post_section_header/FairChanceRiot_2.jpg"/></h6>
                        <h6>2792: Die Flut steigt.</h6>
                        <p>Tag Eins, Null Stunde<br>
                        SSN/CAtv N&auml;chtliche Nachrichten</p>
                        <p><img class="alignright" src="https://robertsspaceindustries.com/media/5pfrw9h2xc3c4r/post/MassacreVidStill.jpg"/>Guten Abend, das sind die SSN/CAtv Nightly News f&uuml;r das Terra System. Ich bin Lawrence Ren. Die Systeme sind begeistert von der bevorstehenden Hochzeit zwischen Val Messer und Celia Carter, so dass wir heute Abend einen Blick auf die Designer werfen, die ausgew&auml;hlt wurden, um die Braut und den Br&auml;utigam&hellip;.</p>
                        <p>&lt;&lt;&lt;&lt;&lt;&lt;&lt;&lt; SYSTEMUNTERBRECHUNG &ndash; UNBEKANNTER URSPRUNG &gt;&gt;&gt;&gt;&gt;&gt;</p>
                        <p>Menschen aller Systeme. Ziehen Sie sich Ihren Schleier von den Augen und lernen Sie zu sehen. Garron II war eine sich entwickelnde Welt mit einer Vielzahl von Arten. Wir sagen &bdquo;war&ldquo;, weil sie es heute nicht mehr ist. Der Imperator und seine Gefolgsleute haben den Planeten terraformt und alles get&ouml;tet, um ihre uners&auml;ttliche Gier zu stillen.</p>
                        <p><strong>TAG EINS,<br></strong>STUNDE DREI<br>
                        POLIZEIKOMMANDOABWEHR</p>
                        <p>FELDEINHEIT: Hier ist Einheit B234. Wir haben eine unbefugte Versammlung in Gitter 14G. Ich brauche zus&auml;tzliche Bodeneinheiten. Luftunterst&uuml;tzung in Bereitschaft.</p>
                        <p><strong>STUNDE F&Uuml;NF<br></strong>Feldeinheit: Holt die Wache! (undeutliches Geschrei und Sch&uuml;sse) Holt die Armee. Schnappt euch, wen ihr kriegen k&ouml;nnt, und bringt sie her! Wir werden &uuml;berrannt. (off-mic) Du! Halt die Klappe und halte sie auf &hellip; jetzt!</p>
                        <p>COMM VERLOREN</p>
                        <p><strong>ZWEITER TAG<br></strong>VON: Admiral Kale, UEE HIGH COMMAND</p>
                        <p>Terroristen versuchen, die Erde anzugreifen. Sie m&uuml;ssen den gesamten Sprungpunktverkehr stoppen. Ich will, dass die Zug&auml;nge in jedes einzelne System abgeschaltet werden. Sie sind berechtigt, t&ouml;dliche Gewalt auf jedes Schiff anzuwenden, das sich nicht umleiten l&auml;sst.</p>
                        <p>Unterschrieben,<br>
                        Admiral Tal Kale<br>
                        AuthCode: GHISJD_HUDFJD_12</p>
                        <p><strong>TAG DREI<br></strong>BEH&Ouml;RDEN&Uuml;BERGREIFENDES MEMO<br>
                        ZU: HOHE F&Uuml;RSPRECHERIN KELLER<br>
                        VON: NARA VALE, AAC &ndash;<br>
                        RE: VERSCHW&Ouml;RER KOMM-VERKEHR</p>
                        <p>Unsere Kr&auml;fte haben aufgedeckt, wie die Aufst&auml;ndischen trotz der Beschlagnahme der CommRelays immer noch zwischen den Systemen kommunizieren. Kommunikationsmeldungen werden in einzelne Datensegmente zerlegt und in die milit&auml;rische Kommunikation eingebettet. Unsere Analysten versuchen herauszufinden, wie sie genau auf unser System zugegriffen haben. Leider wird es einige Zeit dauern, bis sie die Sicherheitsl&uuml;cken gefunden und geschlossen haben, aber hoffentlich wird dies dazu beitragen, sie lange genug zu st&ouml;ren, um die Systeme wieder unter Kontrolle zu bringen. Wird bei Bedarf aktualisiert.</p>
                        <p><strong>TAG 18<br></strong>LUTHER FREIER PRESSE-FLYER<br>
                        Ver&ouml;ffentlicht im Croshaw System<br>
                        FEUER AUF DEMONSTRANTEN ER&Ouml;FFNET&rdquo;</p>
                        <p>Br&uuml;der und Schwestern. Wir haben gerade erfahren, dass vor zwei Tagen Milit&auml;r- und Polizeikr&auml;fte das Feuer er&ouml;ffnet und &uuml;ber zweihundertunddrei&szlig;ig friedliche Demonstranten in Vale get&ouml;tet haben. Wir haben versucht, zivilisiert zu sein. Wir haben dem Drang widerstanden, die Gewalt dieser despotischen Regierung mit Gewalt zu beantworten, aber jetzt sagen wir: Schluss damit! Wir werden nicht mehr nur mit unseren Ideen Krieg mehr f&uuml;hren. Nun werden wir den Imperator von seinem Thron rei&szlig;en. Also, Br&uuml;der und Schwestern, wehrt Euch gegen die teuflische Faust Eures Unterdr&uuml;ckers.</p>
                        <p><strong>TAG 22<br></strong>Neues United NewsOrg Archiv<br>
                        Ver&ouml;ffentlicht am 3. Mai 2792<br>
                        &ldquo;A NEW DAWN&rdquo;<br>
                        von Decklin Farwahl</p>
                        <p>&bdquo;Wir sind aus einem Alptraum erwacht.&rdquo; Das waren die Worte des neuen Imperators Erin Toi gestern nach der Bekanntgabe der Gefangennahme von Imperator Messer XI. Es ist in der Tat ein ganz neuer Tag. Auch bei dieser NewsOrg, lange ein inoffizielles Sprachrohr des Imperators, sind wir endlich in der Lage und ermutigt, die Wahrheit zu schreiben, ohne dass uns die UEE-Zensoren &uuml;ber die Schulter schauen.</p>
                        <p>Kaum zu glauben, dass der Vorfall auf Garron II das Pulverfass war, das alles zum Einsturz brachte. Sicherlich war dies nicht der einzige Katalysator. Es gab Vorf&auml;lle, die darauf aufbauten. Von der Tapferkeit des Senators Akari bis zu den Aktivisten, die all die Jahre trotz Inhaftierung oder Tod B&uuml;ndnisse schmiedeten.</p>
                        <p>Abgesehen von der Einf&uuml;hrung von Amtszeitbeschr&auml;nkungen f&uuml;r den Imperator arbeitet Toi nun mit neu gew&auml;hlten Senatoren zusammen, um die alten Positionen des Tribunals wiederherzustellen. Der neue Hohe Generalsekret&auml;r, der Hohe Sekret&auml;r und der Hohe Advokat werden unter der Position des Imperators arbeiten, aber mit der Macht, sie zu entmachten, sollte ein anderer Despot erneut versuchen, die Kontrolle zu &uuml;bernehmen.</p>
                        <p>Wir sind aufgewacht. Obwohl der Tag, vor dem wir stehen, unbekannt ist, haben wir gesehen, wie weit wir fallen k&ouml;nnen. Also m&uuml;ssen wir sicherstellen, dass jeder Schritt, den wir machen, ein Schritt des Aufstiegs ist.</p>
                        <hr id="2795"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/sfbf62nlhhcaer/post_section_header/FairChance_FI_2_Crop.jpg"/></h6>
                        <h6>2795: Eine sanftere Menschheit</h6>
                        <p><strong>Das Fair-Chance-Gesetz</strong></p>
                        <ul><li>Grunds&auml;tze</li>
                        <li>Bezeichnung der sich entwickelnden Arten</li>
                        <li>Terraforming und Bedingungen</li>
                        <li>Ressourcen f&uuml;r den Umweltschutz</li>
                        <li>Gerichtliche &Uuml;berpr&uuml;fung und Strafverfolgung</li>
                        </ul><p><strong>Abschnitt I</strong></p>
                        <p><em>Grunds&auml;tze</em><br><em>Artikel 1</em></p>
                        <p>Das Ziel dieses Gesetzes ist der Schutz des Lebens und des Wohlergehens von Arten auf Planeten, die sich noch nicht entwickelt haben, aber die vern&uuml;nftige F&auml;higkeit zur Evolution besitzen. Niemand darf einer Spezies ohne triftigen Grund Schmerzen, Leiden oder Schaden zuf&uuml;gen.</p>
                        <p><strong>Abschnitt II</strong></p>
                        <p><em>Bezeichnung der sich entwickelnden Arten</em><br><em>Artikel 2</em></p>
                        <p>Nach der Entdeckung eines neuen Planeten und/oder Systems wird ein unabh&auml;ngiges Gremium, bestehend aus UEE-Vertretern, Exobiologen und Corp-Ingenieuren:</p>
                        <ol><li>nicht-invasive Scans und Bewertungen auf jedem Planeten im System durchf&uuml;hren, um zu verstehen, ob sich das Leben bereits entwickelt hat</li>
                        <li>alle Berichte dem UEE Senatskomitee f&uuml;r Expansion und Entwicklung zusenden</li>
                        <li>die &ouml;kologische Unbedenklichkeit eines jeden Planeten &uuml;berwachen, der sich nach Abschluss zwischen dem unabh&auml;ngigen Gremium und dem Unterkomitee zum Schutz der Entwicklung von Arten entwickelt.</li>
                        </ol><p><em>Artikel 2a</em></p>
                        <ol><li>Das Gremium wird ein System von Kriterien entwickeln und vorlegen, um festzustellen, was als &ldquo;sich entwickelnde Art&rdquo; eingestuft wird.</li>
                        <li>Der UEE-Unterausschuss f&uuml;r Expansion und Entwicklung ist erm&auml;chtigt, im Einvernehmen mit dem Imperator und dem Senat mit Zustimmung des Hohen Sekret&auml;rs Verordnungen zu erlassen.
                        <ol style="list-style-type: upper-roman;"><li>Er kann insbesondere eine Welt als ein Heiligtum einzustufen. In welchem,
                        <ol style="list-style-type: upper-alpha;"><li>alle indigenen Lebensformen von jeglicher menschlicher Beteiligung unber&uuml;hrt zu lassen sind</li>
                        <li>jeder Versuch, Ressourcen, seien sie biologisch oder mineralisch, zu terraformen oder zu gewinnen, strafrechtlich verfolgt wird, wie in Abschnitt V dargelegt;</li>
                        </ol></li>
                        <li>mit Zustimmung und Hilfe des Oberkommandos milit&auml;rische Mittel zur Aufrechterhaltung der Heiligkeit der gesch&uuml;tzten Welt umzuleiten sind.</li>
                        </ol></li>
                        </ol><p><strong>Abschnitt III</strong></p>
                        <p><em>Terraforming Artikel und Bedingungen</em></p>
                        <p>. . . wird fortgesetzt</p>
                        <hr id="2800"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/y48gpgg5wt89wr/post_section_header/TheArk_FI_3_Crop.jpg"/></h6>
                        <h6>2800: Die neutrale Zone</h6>
                        <p>Zu Beginn des 29. Jahrhunderts lud der neu gew&auml;hlte Imperator Marshall Leon Vertreter des Xi&rsquo;An Imperiums, des Banu Protektorats sowie eine Delegation von Tevarin zu einer Galafeier auf einer Orbitalplattform ein. Es wurde auch versucht, die Vanduul einzuladen. Diese Versuche waren aber nicht erfolgreich. Imperator Marshall Leon beruhigte die riesige Menge und sprach:</p>
                        <p>&bdquo;Meine Damen und Herren. Willkommen.</p>
                        <p>Das ist ein Wort, das nicht viel mit der Menschheit in Verbindung gebracht wird. Wir wissen, dass wir in diesen dunklen Jahrhunderten intolerant waren. Wir wissen, dass wir misstrauisch waren. Wir waren grausam. Aber unsere Zivilisation hat ein Sprichwort, das tausende von Jahren zur&uuml;ckreicht: Menschen ver&auml;ndern sich. Und es ist wahr, Menschen k&ouml;nnen sich &auml;ndern. Wir k&ouml;nnen uns &auml;ndern, weil wir den Fehler unserer Wege gesehen haben. Wir k&ouml;nnen uns &auml;ndern, weil wir wollen.</p>
                        <p>Benannt nach dem biblischen Schiff, bauten wir diese Arche als Gef&auml;&szlig; f&uuml;r Raum und Zeit. Ein Ort, um mehr &uuml;ber alle Rassen zu erfahren, &uuml;ber die entdeckten und die noch unentdeckten. Ein Ort, der nicht an einen Planeten oder eine Spezies gebunden ist, denn ihn auf einem Planeten zu platzieren bedeutet, dass er zu der Spezies geh&ouml;rt, die ihn bewohnt. Nein, die Arche muss uns allen geh&ouml;ren. Wir bieten diese Arche dem Universum als Ort des Studiums und der Begegnung an. Die Arche soll als politisch neutrale Zone fungieren, in der sich Vertreter treffen k&ouml;nnen, um Probleme durch Diskurs zu l&ouml;sen.</p>
                        <p>Ich bin stolz, diese T&uuml;ren zu &ouml;ffnen und bitte Sie alle, sie mit der gro&szlig;en und bunten Geschichte zu f&uuml;llen, die jede einzelne Spezies zu bieten hat. M&ouml;ge diese Arche als Zeugnis und stolze Aufzeichnung des Lebens stehen, das wir und alle vor uns alle gelebt haben.&ldquo;</p>
                        <hr id="2872"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/kq48emqkgtieqr/post_section_header/Synthworld_FI_1_Crop.jpg"/></h6>
                        <h6>2872: Projekt Archangel</h6>
                        <p><img class="alignright" src="https://robertsspaceindustries.com/media/2pjasiddxiuter/post/SynthWorld_2-300x168.jpg"/>Neues United NewsOrg Archiv<br>
                        Ver&ouml;ffentlicht: 3.5.2872<br>
                        &ldquo;Synthworld&rdquo;<br>
                        Von Peter Marx</p>
                        <p>Wir stehen an der Schwelle zum Fortschritt. Das war die Stimmung heute Morgen im Senat, als der Imperator seine Ank&uuml;ndigung machte. Die Regierung enth&uuml;llte schlie&szlig;lich das Projekt Archangel, &uuml;ber das bereits seit Wochen in den Nachrichtenkreisen gemutma&szlig;t wird.</p>
                        <p>Kurzum, das Projekt Archangel ist eine von der UEE geleitete Initiative, um einen Planeten buchst&auml;blich von Grund auf neu aufzubauen. Die Menschheit hat endlich eine L&ouml;sung gefunden, die das komplizierte moralische Minenfeld des Terraformings vermeidet. Wir m&uuml;ssen keine bereits existierenden Planeten mehr umwandeln. Jetzt k&ouml;nnen wir sie bauen. Obwohl die Technologie noch nicht komplett zu Ende entwickelt ist, glauben die Wissenschaftler, dass sie in der Lage sein werden, noch zu unseren Lebzeiten eine Prototyp-Welt aufzubauen.</p>
                        <p>Die Auswirkungen haben sich mittlerweile bereits in Wissenschaft, Politik und sogar im sozialen Bereich niedergeschlagen. Xi&rsquo;An Emperor Kr.&#275; gab sogar ein Statement heraus: &bdquo;Es ist sehr ermutigend. Meine Leute werden die Entwicklung des Projekts mit gro&szlig;em Interesse verfolgen.&rdquo;</p>
                        <p>Wenn sie perfektioniert w&uuml;rde, w&uuml;rde die Synthie-Welt helfen, die Schande zu beseitigen, die die Menschheit nach drei Jahrhunderten des ungez&uuml;gelten Imperialismus zu tragen hatte. Der Imperator beendete seine Rede, indem er alle Wissenschaftler aus der Banu- oder Xi&rsquo;An-Zivilisation einlud, die Entwicklung hautnah mitzuerleben: &bdquo;Wir wollen diese Technologie nicht f&uuml;r uns behalten. Die F&auml;higkeit, Welten zu bauen, sollte f&uuml;r alle Kulturen frei sein, so dass es nie wieder n&ouml;tig sein wird, um so etwas Triviales wie Land zu k&auml;mpfen.&rdquo;</p>
                        <hr id="2920"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/5gcann5oq2xt9r/post_section_header/SynthworldEditorial_FI_3_Crop.jpg"/></h6>
                        <h6>2920: Die Geldgrube</h6>
                        <p>TERRA GAZETTE NEWSORG ARCHIV<br>
                        URSPR&Uuml;NGLICH VER&Ouml;FFENTLICHT: 5.38.2920<br>
                        &ldquo;Finanzieller Sprungpunkt&rdquo;<br>
                        Von Kali Hanks</p>
                        <p>Da drau&szlig;en ist eine Raumanomalie. Es ist eine Art Sprungpunkt, den aber kein Pilot jemals durchfliegen wird, weil er nur Geld hineindurchl&auml;sst, das anschlie&szlig;end nie wieder gesehen wird. Ich rede nat&uuml;rlich vom Synthwelt-Unsinn. Es ist fast f&uuml;nfzig Jahre her, seit sie das Projekt Erzengel angek&uuml;ndigt haben, und offen gesagt, was haben wir bis heute bekommen?</p>
                        <p>F&uuml;r mich scheint es, als w&auml;ren wir der k&uuml;nstlichen Schaffung einer Welt nicht n&auml;her als damals, als es noch Versprechen und Hoffnung waren. Die einfache Wahrheit ist, dass dieser Versuch, eine Synthworld zu bauen, zu Lasten aller anderen Welten geht. Und wir haben eine Regierung, die so verzweifelt ist, dass sie bereit ist, sogar das Milit&auml;r und die Infrastruktur leiden zu lassen, um sich das Projekt weiter leisten zu k&ouml;nnen.</p>
                        <p>Ich verstehe es, das tue ich wirklich. Sie bauen das wegen all der Rassen, die w&auml;hrend der Terraforming-&Auml;ra ausgel&ouml;scht wurden. Es ist eine tolle Idee, sicher, aber genug ist genug. Ich denke, f&uuml;nfzig Jahre Misserfolg sollten ein guter Indikator daf&uuml;r sein, dass wir etwas anderes ausprobieren sollten.</p>
                        <p>Jedes Jahr bekommen wir neue Zusicherungen, dass die Wissenschaftler angeblich &bdquo;neue Fortschritte&rdquo; machen. Dass sie endlich herausgefunden haben, wie man den Wachstumsprozess stabilisieren kann. Doch was haben wir nach all der Zeit? Eine sich verschiebende instabile Planetenmasse.</p>
                        <p>Wir m&uuml;ssen jemanden an die Macht bringen, der den Mut hat, Stop zu sagen. Entweder muss jemand diese Politik durchkreuzen und den Stecker ziehen oder der Rest der Systeme wird damit zusammenbrechen. Das ist vielleicht nicht popul&auml;r, aber ich garantiere, dass die Leute genauso denken. Es war die gro&szlig;e Idee der Erde, die schrecklichen Dinge, die sie w&auml;hrend der Messer-&Auml;ra getan haben, wieder gutzumachen. Wir in Terra haben ein reines Gewissen, denn unsere Vorfahren haben es geschafft, sich von der Scheu&szlig;lichkeit dieses Zeitalters zu distanzieren. Wenn die Erde will, dass dieses l&auml;cherliche Projekt ihr Gewissen reinigt &ndash; gut. Aber ich verstehe nicht, warum wir mit diesem Schiff untergehen m&uuml;ssen. Vielleicht ist es Zeit, uns auf uns selbst zu besinnen.</p>
                        <hr id="2928"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/sat5rb0bzlj9wr/post_section_header/Imperator_FI_1_Crop.jpg"/></h6>
                        <h6>2928: Eine neue Kampagne</h6>
                        <p><img class="alignright size-medium wp-image-31785" src="https://starcitizenbase.de/wp-content/uploads/2018/07/KelosCampaignPoster_1-213x300.jpg" alt="KelosCampaignPoster 1" width="213" height="300">An: UEE-Unterausschuss f&uuml;r Frequenzgenehmigung<br>
                        Kelos Costigan Wahlspot<br>
                        TRT: 30 Sek.<br>
                        Prod: Martin Balish<br>
                        Kommerzieller Typ: A/V/NPS<br>
                        AD BEGINS. V/O und Bilder:</p>
                        <p>Ein Budget, das au&szlig;er Kontrolle ger&auml;t. Die Zukunft des Synthworld-Projekts in Frage gestellt. Vanduul-Angriffe auf dem Vormarsch in den westlichen Systemen. Probleme f&uuml;r uns alle. Es ist schwer, den &Uuml;berblick zu behalten, wenn man versucht, eine Familie durchzubringen. In Zeiten wirtschaftlicher Instabilit&auml;t wollen sie nun einen Imperator, der das Schiff wieder auf Kurs bringt.</p>
                        <p>Dieser Kandidat ist Kelos Costigan.</p>
                        <p>Als Wirtschaftsstratege mit mehr als zwei Jahrzehnten Erfahrung hat Kelos dutzenden Welten geholfen, die technologische Gleichheit zu erreichen, die f&uuml;r die meisten von uns selbstverst&auml;ndlich ist. Die in seiner zweiten Amtszeit als Generalsekret&auml;r verordnete Politik brachtedas h&ouml;chste Wachstum seit siebenunddrei&szlig;ig Jahren. Er hat die Erfahrung und das Wissen, um die Menschheit aus den roten Zahlen heraus und wieder in die schwarzen Zahlen zu bringen.</p>
                        <p>Ende Titel/Text:</p>
                        <p>Bitte durchsuchen Sie Kelos Costigan, um mehr &uuml;ber seine Politik zu erfahren. Diese Botschaft wurde unter der Zustimmung von Kelos Costigan Campaign erstellt. UEE-Organisationscode: #5985938GH</p>
                        <hr id="2934"><h6><img class="aligncenter" src="https://robertsspaceindustries.com/media/jkfgas4ihmfghr/post_section_header/BookReport_FI_2.jpg"/></h6>
                        <h6>2934: Ein Tr&auml;umer tr&auml;umt</h6>
                        <p>Brian Wieters<br>
                        EBook-Bericht<br>
                        Frau Ngo, Klasse 5<br>
                        &ldquo;Burning Sky:&nbsp; A Squadron 42 Adventure&rdquo;.</p>
                        <p>In der Pause las ich Burning Sky. Es drehte sich um Squadron 42. Die Geschichte spielt im Jahr 2910, als ein Haufen Vanduul-Kriegsschiffe ihren Tr&auml;ger angriffen. Die Hauptfigur war Lieutenant Terrence Nolan. Er kam aus einer kleinen Stadt im Elysium-System, &auml;hnlich der, in der mein Cousin lebt. Er trat der Flotte bei, anstatt zur Schule zu gehen, weil er die Sterne sehen wollte. Es gab eine gute Szene, in der er drau&szlig;en auf den Feldern stand und in den Himmel blickte und sich fragte, was da drau&szlig;en wohl alles sein w&uuml;rde. Er wollte sehen, was niemand je zuvor gesehen hatte. Gibt es zum Beispiel Aliens, die wir noch nicht kennen? Daran habe ich nie gedacht. Wenn ich Pilot bin, will ich nur einen Nebel sehen. Einen gro&szlig;en. Ich denke, das w&auml;re das Maximum.</p>
                        <p>Nach der Flugschule wurde Lt. Terrence Nolan zun&auml;chst in die &ouml;stlichen Sektoren versetzt. Er war Teil einer Patrouille an der Grenze zu den Xi&rsquo;An. Er war ziemlich gelangweilt, weil nichts passierte. Dann, in einer Schicht, sah er pl&ouml;tzlich ein kleines Transportschiff, das von Piraten verfolgt wurde. Obwohl es vier Piraten gab und Lt. Nolan allein war, griff er an. Es war verr&uuml;ckt und sein Schiff wurde in die Luft gejagt, aber er schoss drei Piraten ab, bevor weitere auftauchten. Damit rettete er den Transport. Danach wurde Nolan begl&uuml;ckw&uuml;nscht &ndash; und doch von seinem Kommandanten heruntergeputzt. Er war w&uuml;tend, weil es dumm war, es allein mit vier Piraten aufzunehmen. So wurde Nolan in die Squadron 42 eingezogen.&nbsp; Dort m&ouml;gen sie diese Art von Dummheit.</p>
                        <p>So wurde Lt. Nolan zur&uuml;ck in die westlichen Systeme versetzt. Jetzt ist er Teil der Staffel. W&auml;hrend der Rest der Flotte von der Vanduul wegl&auml;uft, suchen sie stets den Kampf. Sie sind das Einzige, was zwischen unseren Systemen und ihren J&auml;gern steht. Ihr Kommandant ist diese kluge, z&auml;he Dame namens Aria Reilly. Sie hat ihr ganzes Leben lang gek&auml;mpft, seit ihre Stadt von J&auml;gern niedergebrannt wurde. Ihr Tr&auml;ger flog an den Siedlungssystemen vorbei in den nicht beanspruchten Raum. Sie waren auf der Jagd.</p>
                        <p>Nach zwei Wochen auf dem Tr&auml;ger schien es, als ob niemand Lt. Nolan mochte. Sie hielten ihn alle f&uuml;r einen Schw&auml;chling. Aber am n&auml;chsten Morgen wurde ihr Schiff von einem Haufen Vanduul Scythes &uuml;berfallen. Lt. Nolan und die anderen Piloten sprangen in ihre Schiffe, um sie zu bek&auml;mpfen. Die Schlacht dauerte sechs Stunden. Die K&auml;mpfer drehten sich durch den Raum und versuchten sich gegenseitig in die Luft zu sprengen, w&auml;hrend der Tr&auml;ger einen Vanduul-Zerst&ouml;rer bek&auml;mpfte. Es sah aus, als w&uuml;rden sie verlieren, aber dann &uuml;bernahm Lt. Nolan das Kommando &uuml;ber die noch lebenden Piloten und k&auml;mpfte noch h&auml;rter.&nbsp; Sie haben nicht aufgegeben, egal was passierte.</p>
                        <p>Das Lesen dieses Buches hat Spa&szlig; gemacht. Es war etwas langweilig vor den K&auml;mpfen, aber ich bin froh, dass ich dabei geblieben bin. Mein Vater sagt, dass er sich daran erinnern kann. Als Kind liebte auch er die Squadron 42. Ich hoffe, dass ich eines Tages wie Leutnant Nolan bin, wenn ich Pilot werde.&nbsp; Ich denke, das sollte jeder lesen. Das ist mein Bericht.&ldquo;</p>
                        <hr><h6>2950</h6>
                        <p>Heute.</p>

