                    <div id="uee-reg" class="tabcontent">

                        <h1 class="short-hr-left" style="font-family: 'Nasa'; float: left;">Excurs - UEE & Regierung</h1>

                        <br>

                        <img src="https://www.ariscorp.de/assets/img/excurs/uee-reg/UEE-City-Center.jpg" alt="UEE-City-Center" width="100.9%" height="auto">

                        <br>
                        <br>
                        <br>

                        <span>Als die Menscheit in das Sonnesystem aufbrach, wusste sie, dass sie fr groe Dinge bestimmt war. Whrend sie noch kleinere Differenzen hatte, vereinte sie die Expansion ins Universun dennoch als eine Spezies. Planeten wurden terraformt, un wachsendem Ressourcenbedarf gerecht zu werden, so dass die uberbefolkerung der Erde bald kein Problem mehr war. Die Menscheit schloss sich zusammen, um sich den monumentalen Herausforderungen zu stellen, die vor ihr lagen.</span>

                        <br>
                        <br>

                        <span>Auf der Reise stiess die Menschheit auf ne ausserirdische Zivilisationen. Einige waren freundlich gesinnt, wie zum beBeispiel die handelsorientierten Banu - andere hingegen nicht. Eine stolze Kriegerrasse, bekannt als Tevarin, lOESte den ersten und zweiten interstellaren Krieg der Menschheit aus. Das Xi'an-Inperium unterhielt mit den Menschen eine khle Beziehung.</span>

                        <br>
                        <br>

                        <span>Der Kampf ums berleben fhrt die Menschheit schliesslich auf einen dunklen Pfad. Ein brilliantervund manipulativer Soldat namens Ivar Messer schrte Angst, um sich schliesslich als erster Imperator der Erde aufzuschwingen und die bis dahin unabhngigen Planeten zu einem Empire zu formen. Hunderte Jahre regierte die Dynastie der Messers das Vereinigte Empire Empire der Erde mit Hrte und Kontrolle, bis das Volk aufstand, um die despotischen Herscher zu strzen und die korrupte Regierung in eine Institution des Volkes zu wandeln.</span>

                        <br>
                        <br>

                        <span>Heute wird die UEE von Senatoren regiert, die von Brgern aus dem ganzen Empire gewhlt werden, wrend das Militr die Grenzen des Empires mit rieseigen Kanpfschiffen schtzt. Gleichzeitig gedeiht der Handel zwischen den Systemen und Spezies. Mit dem Ende des Jahrhunderts zeichnen sich jedoch ne Probleme am Horizont ab, die viele dazu veranlassen, sich zu fragen, ob die UEE weiterhin berleben kann.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">Das Jahr 2950</h2>
                        <span>Im Jahr 2950 also heute, leben die Menschen auf mehr Welten in mehr Systemen als zu irgendeinem anderen Zeitpunkt in der Geschichte. Unternehmen der Xi'an operieren offen im vom Menschen besiedelten Raum und ne Handelsabkommen sehen noch mehr Mglichkeiten vor.Zum ersten Mal berhaupt wird ein Tevarin in den Senat gewhlt. Menschen haben eine bessere Chance als je zuvor, ein erfolgreiches und Glckliches Leben zu fhren. Aber das soll nicht so bleiben.</span>

                        <br>
                        <br>

                        <span>Die Grenzen des Empires werden von den Vanduul belagert und der Grossteil der millitrischen Macht der UEE widmet sich der Kriegfhrung. Dies belastet den Haushalt der UEE, der durch massive Projekte wie die Synthworld, ein ehrgeiziges Experiment zur Schaffung einer knstlichen nen Welt, ohnehin unter Druck ist. Whrend sich das Empire bemht, ber die Runden zu kommen, gewinnen kriminelle Organisationen an Strke und es wird mehr auf Milizen und private Sldnergruppen vertraut, um die Sicherheit im Empire zu gewhrleisten. Einige glauben, dass die Zeit des Empires Ende geht und Gruppen wie die Terranischen Separatisten oder die People's Alliance versuchen, so schnell wie mglich eine ne ra des Wandels einzuleiten.</span>

                        <br>
                        <br>

                        <span>Mehr noch: Obwohl es so aussieht, als wrden sich die xeno-diplomatischen Beziehungen nach und nach verbessern, scheint es unter der oberflche doch zu brodeln. Kann man den Xi'an wirklich vertran ? Haben sie nach Jahrhunderten des Misstrans wirklich nur das Beste fr die Menschheit im sinn oder ist ihr wirtschaftliches Engagement in die UEE nur ein Versuch, die Menschheit zu schwchen ? Die Banu sind zwar stndige Handelspartner, aber mit ihrer anhaltenden Beteiligung am Slavenhandel und ihrer launischen Natur- wie lange wird es darn, bis ihnen jemand ein besseres Angebot macht und sie die Menschen verraten? Viele Tevarin sind mit ihrem Platz in der UEE unzufrieden und flstern ber die mgliche Wiedergeburt einer eigenen Nation. Kurz: Die Liste der Feinde der Menschheit knnte bald mehr als die Vanduul umfassen...</span>

