                        <h2 style="font-family: 'Nasa'">Das United Empire of Earth (UEE)</h2>
                        <span>Die Regierung des UEE ist auf verschiedene Abteilungen aufgeteilt.</span>
                        </div>

                        <br>

                        <br>

                        <h2 style="font-family: 'Nasa'" style="float: left;">Imperator</h2> <img src="https://www.ariscorp.de/assets/img/excurs/uee-reg/addison.jpg" alt="" style="float: right;" width="30%" height="auto">
                        <span>Ursprnglich der Diktator. Nach der Messer-ra strkturierte die UEE die Funktion des Imperators um. Heute ist er mehr ein "Prsident". Er wird denokratisch gewhlt, seine Amtszeit ist befristet. Die Position ist dazu da, um die endgltigen Entscheidungen im Verse zu treffen. Gesetze werden im Senat vorgeschlagen und besprochen, dann dem High Secretary vorgelegt, schliesslich genehmigt sie der Imperator oder er legt sein Veto ein.</span>


                        <br>
                        <br>

                        <span>Laylani Addison, geboren 2889, ist unsere aktuelle Imperatrix im United Empire of Earth (UEE). Zuvor war sie Dekanin fr angewandte Wissenschaften (2931-2947) und davor neun Jahre Professorin fr integrierte Wissenschaft und Xenotechnologie an der Mentor University.</span>

                        <br>
                        <br>

                        <span>Ihr Wahlprogramm umfasst Plne fr eine Innovationsinitiative, die die derzeitigen Beschrnkungen fr KI-Forschung lockern und die Ausgaben fr Bildung und wissenschaftliche Forschung erhhen wird. Sie versucht, die Finanzierung von ffentlich subventionierten Universitten zu steigern, die Beziehungen zwischen menschlichen und auerirdischen Zivilisationen zu strken, mehr Mittel fr Synthworld bereitzustellen und ein Regierungsprogramm zu schaffen, um das verlorene menschliche Kolonieschiff "Artemis" zu lokalisieren. Sie ist keiner politischen Partei angeschlossen.</span>

                        <br>
                        <br>
                        <br>
                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">High Secretary</h2>
                        <span>Er wacht ber alles, was in der UEE fr das Zusammenleben von grosser Bedeutung ist - Kommunikation, Transport, Abwasser, Strom, Landwirtschaft, und anderes mehr. Alle Fragen im Zusammenhang mit der Infrastruktur der UEE werden vom Senat diskutiert, dann an den High Secretary weitergeleitet, bevor auch der Imperator darber befindet.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">High Advocate</h2>
                        <span>Er ist der Generalstaatsanwalt der UEE. Sein Bro kmmert sich um die Durchsetzung von Gesetzen, stellt aber auch sicher, dass die lokalen Regierungen der UEE die neusten nderungen der geltenden UEE-Gesetze einhalten.</span>

                        <br>

                        <span>Der High-Advocate und die nachfolgenden Abteilungen bernehmen die rechtlichen und Polizeilichen Aufgabendes Empire- gegrndet im Jahr 2523, als die United Nations of Earth (UNE) in die United Planets of Earth umgestaltet wurden. Die Advocacy wurde hierzu als eine system-bergreifende Polizei unter dem High Advocate konzipiert. Whrend der faschistischen Messer-ra bernahm die Advocacy eine dunkle Rolle als Geheimpolizei, Geheimdienst und Spionagebehrde des Imperators. Das gena Ausmass ihrer Handlungen ist noch unbekannt, aber die Advocacy- Beamten waren damals offenbar in Morde, willkrliche Verhaftungen und Folter verwickelt.</span>

                        <br>

                        <span>Als der Imperator fiel, wurde die Advocacy zu ihrem ursprnglichem Zweck wiederhergestellt. Whrend die meisten Planeten sich seitdem selbst berwachen, verfolgt die Advocacy Verbrechen, die planeten- und  systembergreifend verfolg werden. Dazu zhlen auch so genante Extraktionen, also Verfolgen in Banu- oder Xi'an-Gebiet. Advocacy Agents werden in der Regel von Kriminellen gefrchtet. Sie sind gut ausgebildet, zu gleichen Teilen Fliegerass und grndlicher Ermittler.Die meisten Advocacy-Agenten arbeiten allein, aber es knnen auch ganze Teams fr hochkartige Ziele oder komplizierte Situationen eingesetztbwerden. </span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">Senatoren</h2>
                        <span>Gewhlt von den Brgern ihrer jeweiligen Planeten, arbeiten Senatoren hauptschlich im UEE-senat. Senatoren schaffen keine direktelokale Gesetzgebung oder ernennen lokale Beamte, aber ihre Untersttzung und ihr Einfluss sind unbestreitbar mchtig.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">Parteien</h2>
                        <span>Aufgrund der enormen Gre des UEE gibt es hunderte verschiedene politischeParteien, aber es gibt drei, die die politische Landschaft dominieren. </span>

                        <br>
                        <br>

                        <span style="font-size: 120%; font-weight: bold;">Universalisten </span><span> - Institutionsfokussierte ideologie. Regierung und Systeme leiten die Menschen. Von manchen als vermgensorientiere Ideologie angesehen.</span>

                        <br>
                        <br>

                        <span style="font-size: 120%; font-weight: bold;">Zentralisten </span><span>- Liberale polotische Ideologie. Es geht darum, den Status quo zu pflegen. Die Partei setzt sich dafr ein, dass die Erde der wichtigste Ort des UEE ist und bleibt.</span>

                        <br>
                        <br>

                        <span style="font-size: 120%; font-weight: bold;">Transitionalisten </span><span> - Relativ junge "Volkspartei". Der greste Teilihrer Rhetorik ist auf "Zukunft" Und "Fortschritt" gerichtet. Sie Untersttzen Terra als das knftige Zentrun des UEE.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">Der UEE-Senat</h2>

                        <img src="https://www.ariscorp.de/assets/img/excurs/uee-reg/UEE_Senat.png" alt="UEE-Senat">

                        <br>

                        <span>Es gibt viele Systeme unter UEE-Kontrolle. Jedes System besteht aus einer Handvoll Planeten, einige sind terrqformt fr die Besiedelung, auf anderen werden Ressourcen abgebaut und wieder andere sind nur nutzlose Felsbrocken im All. Wenn ein Planet eine bestimmte Bevlkerungszahl oder einen gewissen Einfluss erreicht hat, kann er die Anerkennung durch die Regierung beantragen. Wenn der Planet hierbei erfolgreich ist ,darf er einen Brger whlen, der ihn im Senat vertritt. Dieser Senator dient fr jeweils fnf jahre und kann mehrere Amtszeiten absolvieren. Nur die greste und einflussreichsten Planeten besitzen mehrere Senatoren. Im Senat werden die grossen Probleme des UEE debattiert. Ziel im Senat ist es auch, nach der dunklen ra des Messer-Regimes eine Art Wiedergutmachung zu leisten.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">Lokale Regierungen</h2>
                        <span>Das Leben im UEE bietet ein breites Spektrum an Erfahrungen. Im Jahr 2948 haben sich die verschiedenen Ethnien komplett vermischt. Die verschiedenen Sprachen und Wurzeln gibt es nach wie vor, haben aber auch viel Nes kreiert. jeder Planet Muss Lobbyarbeit leisten, um sich einen Sitz im Senat zu erobern. Es gibt somit zwei Kategorien - "Vertreten" und "nicht vertretent".</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">"Vertreten"</h2>
                        <span>Das bedeuten, dass der Planet einen Sitz im Senat des UEE hat - von Terra und seiner Milliarden-Population bis zu kleinen Ballungzentren auf Magnus.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">"Nicht vertreten"</h2>
                        <span>Sobald UEE- Inspektoren einen Planeten als sicher fr die Besiedelung zertifizieren, sind Mitglieder der Terraforming-Teams oft gleichzeitig auch die ersten Siedler. Es folgen of weitere Gutachter. Sie forschen nach allem, was denPlaneten als potetiell greste bevlkerungszentrum etablieren knnte. Dies Knnen einzigartige Mineralien oder weitere Sprungpunkte sein. Sie hoffen stets, dass nchste Terra gefunden zu haben. Wenn sie nichts Interessantes finden, ziehen sie weiter. Unterdessen kommen die ganzen Glksritter.</span>

                        <br>

                        <span>Diese Planeten sind zu diesem Zeitpunkt weder in Senat vertreten noch stehen sie unter dem Schutz des UEE-Millitrs. Dies kann zwar spannend fr Hndler sein, die fderale zlle vermeiden wollen, bedeutet aber auch, dass Piraten und Banditen hinter jeder Ecke larn knnen, nicht zu vergessen die Mglichkeit von Vanduul-Angriffen, die jederzeit erfolgen knnen. Die Regierungen handeln daher sehr regional orientiert, in der Regel unter der Leitung eines Gouverneurs. Meist existiert auch eine Art Polizei oder Miliz. Im schlimmsten Fall mssen sich die Koloniebewohner selbst schtzen.</span>

                        <br>

                        <span>Wenn die Bevlkerung auf diesem nicht vertretenen Planeten zu wachsen beginnt, entsendet das UEE schliesslich politische Berater, um die Bevlkerung beim Aufbau ihrer planetarischen Regierung zu beraten. Zunchst gibt es nur wenig Unterscheidungen zwischen Brgern und Zivilisten. Wenn die Bevlkerung wchst, kristallisieren sich diese Unterschiede aber langsam heraus. Der lokale Governeurs-Rat beantragt beim UEE schliesslich die Anerkennung. Wenn sie akzeptiert wird, sind die Brger die einzigen, die an den Senatswahlen teilnehmen drfen. Als Teil des UEE unterliegen auch die kleinsten Siedlungen den Gesetzen des UEE. Lokale Regierungen sind berechtigt, zudem eigene Gesetze zu erlassen, solange sie nich im wiederspruch zu denen des UEE stehen.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">Gouvereureur</h2>
                        <span>Was frher Nationen waren? sind heute nur noch staaten, die sich von voneinander abgrenzen. Dnn besiedelte Welten knnen Rte von zwei Gouverneuren haben, whrend dicht besiedelte Welten Dutzende stellen knnen. Ratssitzungen werden einberufen, um Streitigkeiten beizulegen und durch Abstimmungen die auf den jeweiligen Welten gltigen Gesetze zu ratifizieren.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">Strafverfolgung</h2>
                        <span>Die Strafverfolgung ist in lokale und fderale Polizeikrfte geteilt. Dien lokale Polizei hat ihre eigenen zugewiesenen Gerichtsbarkeiten, whrend die fderale Polizei Verbrechen ber die Staatsgrenzen hinweg bearbeitet unddem Gouverneursrat Bericht erstattet. Je nach Lage und Status des Planeten knnen die Polizeikrfte das UEE-Millitr um Schutz, Intervention oder Untersttzung etwa im Falle einer Naturkatastrophe bitten.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">Geheimdienst</h2>
                        <span>Office of Executive Services (OES)</span>

                        <br>
                        <br>

                        <span>Hinter einem langweiligen Namen in den labyrinthartigen Eingeweiden des Senatshaushaltes versteckt, ist das "Office of Executive Services" die entscheidende Abteilung der UEE fr die Sammlung, Analyse oder Nutzung von Informationen und Erkenntnissen zur Untersttzung von Strafverfolgung, imperialer Sicherheit, Verteidigung und geheimen aussenpolitischen Zielen. Das Office wurde eingerichtet, um zu verhindern, dass sich eines Tages erneut ein Despot erhebt. Da die Abteilung nie offiziell eingefhrt wurde, weiss niemand genau, wann das Bro gegrndet wurde. Die erste bekannte Erwhnung erfolgte im Archiv der Sitzung des Senatsausschusses im Jahr 2794. Aber erste mgliche Hinweise deuten auf eine Aktion bereits sechs Jahre zuvor hin.</span>

                        <br>

                        <span>Nathan Warrick, ein Leiter der Advocacy-Abteilung im Terra-System, half damals das Treffen von Senator Akari mit den Xi'An zu erleichtern, um den Vertrag zwischen beiden Spezies vorzubereiten, der die Spannungen mit den Xi'An abban und den Beginn des Endes der Messer-ra einleiten sollte. Nach diesem Vorfall verliess Warrick die Advocacy und verschwand. Nach dem Sturz des Messer-Regimes erschien Warrick wieder als "Berater", bevor er im Jahr 2794 whrend dieser Sitzung des Senatsausschusses zum ersten Direktor des "Office of Executive Services" ernannt wurde. Die ffentlichkeit weiss hingegen nicht, dass das Bro berhaupt existiert. Es gibt natrlich Gerrchte, aber die verleugnung der Existens hatte von Anfang an oberste Prioritt.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">Behrden</h2>
                        <span>Department of Transportation and Navigation (DTN)</span>

                        <br>
                        <br>

                        <span>Das Department of Transportation and Navigation (DTN) ist ein Zweig der UEE-Regierung, die den Intersystemverkehr reguliert. Die Verwaltung von Weltraumverkehrswegen, Schifffahrtsrouten, Quantenreisepunkten und Sprungpunkten fllt unter die Schirmherrschaft des DTNs. Das Verkehrssicherheitsamt (TSB), ein Teil des DTNs, legt Regeln und Vorschriften fr die Flugsicherheit fest.</span>

