                        <h1 class="short-hr-left" style="font-family: 'Nasa'; float: left;">Excurs - Leben im UEE</h1>

                        <br>
                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">Schulische-quivalenz</h2>
                        <span>Die Grund-Ausbildung erfolgt digital und ber Computersysteme. Eine Vielzahl von Unternehmen hat durch imperiale Subventionen Lernprogramme geschaffen, die in der Lage sind, Kinder zur Erreichung der Gleichwertigkeit, der so genannten "guivalenz", vergleichbar mit dem Niveau einer High School im 21. Jahrhundert zu erzielen. Diese Programme werden in der Regel auf Grenzplaneten und in lndlichen Gebieten eingesetzt, die keinen direkten Zugang zu einer Schule haben.  Es handelt sich im Grunde genommen um ein Multiple -Choice-Quiz, so dass es sehr wenig Mglichkeiten gibt, interpretatives Denken zu entwickeln. Es geht nur darum, Fakten zu vermitteln.</span>

                        <br>

                        <span>Der nchste Schritt ist eine ffentliche Schule. Einige ffentliche Schulen, zum Beispiel in den Megacitys, unterrichten bis zu fnfhundert Schler in einem Klassenzimmer gleichzeitig. In dieser Umgebung wird der grsste Teil des Wissens ber Monitore vermittelt, aber es gibt auch immer noch einen Lehrer, der sich um die gelegentlichen Fragen kmmert und Essays bewertet. Der dritte Schritt ist eine private Akademie, die zwar tr ist, aber die besten Bildungsdienstleistungen von qualifizierten Lehrern anbietet. Diese Akademien bieten Stipendien fr aussergewhnliche Studenten, aber viele argumentieren, dass dies nur dazu dient, Zugang zu erhhter Budgethilfe zu erhalten.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">Nachquivalenz</h2>
                        <span>Nach Erreichen der quivalen zhat ein Student mehrere Mglichkeiten: Eintritt ins Berufsleben, Eintritt ins Militr oder eine Hochschulbildung. Whrend die erste Option in der Regel keinen Gleichwertigkeitsnachweis erfordert, tun es das Militr und die Universitten. Das Militr bietet engagierten Bewerbern quivalenz kurse an, kann aber auch auf die quivalenz forderung verzichten, wenn der Rekrut ber "wnschenswerte Fhigkeiten" verfgt. Da die Hochschulbildung allein nicht fr die Staatsbrgerschaft qualifiziert, tritt eine grosse Zahl von Hochschulabsolventen dem Militr bei.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'">Das Militr des UEE</h2>
                        <img src="https://www.ariscorp.de/assets/img/excurs/uee-reg/UEE_Fleet.png" alt="UEE Fleet" width="80%" height="auto"> <br>

                        <span>Whrend es in vielen UEE- Systemen, insbesondere in den bevlkerungsreicheeren, eine umfassende Sicherheit gibt, haben die anhaltenden Gefahrendes Weltraums dazu beigetragen, eine Kultur des fortwhrenden Militrdienstes zu schaffen. Einige sehen den Militrdienst als Pflichtbung, andere einfach als einen schnelleren - wenn auch potenziell gefhrlichen - Weg, die Staatsbrgerschaf zu erlangen, und wieder andere sehen das Militr als Vollstrecker einer Regierung, die versucht , die Versucht, sich hinter einer freundlichen Fassade zu verstecken. Mit anderen Worten, die Reaktion der ffentlichkeit auf das Militr ist unterschiedlich. Aufgrund der grossen Prsenz des Militrdienstes, hat ein grosser Teil der Bevlkerung entweder beim Militr gedient oder kennt jemanden, der es getan hat.</span>

                        <br>

                        <span>Das Militr ist in drei Divisionen aufgeteilt: Navy, Army und Marines. Als Ivar Messer seine Macht konsolidierte, verband er die Befugnisse des High-Generals mit der Position des Imperators, um zu verhindern, dass eine andere Regierungsfraktion das Militr gegen ihn einsetzen konnte. Im Zuge dessen wurde das UEE High Command gegrndet, ein Ausschuss der einzelnen Teilstreitkrfte, der zudem dafr sorgte, dass die Befehle des Imperators schneller und effektiver umgesetzt wurden. Dieses UEE High Command gibt es noch heute. Technisch gesehen ist der aktlle  Imperator daher immernich der High-General.</span>

                        <br>
                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Navy</h2> <img src="https://www.ariscorp.de/assets/img/excurs/uee-reg/UEE_Navy-new.png" alt="UEE-Navy" style="float: right;" width="32%" height="auto">
                        <br> <br> <span>Die Navyist der grsste Teilbereich und das ffentliche Gesicht des UEE-Militrs. Die Navy ist verantwortlich fr den Transport militrischer Ressourcen, die Sicherung der Grenzen und die Durchfhrung von Militrangriffen in der gesamten UEE. Die Navy ist in fast jedem System des Empires im Einsatz. In den frhen Tagen der Expansion der Menschheit in den Weltraum diente die Navy in erster Linie als Polizei und patrouilierte die Systeme. Nach der Entdeckung der Banu erkannte die Regierung, dass die Navy als militrische Prsenz neu ausgerichtet werden musste. Die Flotte begann zu wachsen, da sie die offensichtlichste visuelle Darstellung der militrischen Strke der Menschheit war. Motiviert von Geschichten und Videos mutiger Piloten, meldeten sich zahlreiche Rekruten an.  Whrend der Messer-ra wuchs die Navy zusammen mit dem Rest des UEE-Militrs weiter an. Strukturell ist die UEE Navy in Squadrons aufgeteilt, denen ein Bengal Trger und eine bestimmte Anzahl Untersttzungsschiffe zugeordnet sind. Ein Admiral ist fr den Trger und die Staffel verantwortlich. Die Rekruten trainieren im Schatten der riesigen Werften an den Akademien und in Bootcamps auf MacArthur im Kilian-System.</span>

                        <br>
                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Army</h2> <img src="https://www.ariscorp.de/assets/img/excurs/uee-reg/UEE_Army.png" alt="UEE-Army" style="float: right;" width="32%" height="auto">
                        <br> <br> <span>Die Army ist eine sehr gut ausgerstete Bodentruppe, die bei landgestzten militrischen Operationen eingesetzt wird und ein wachsames Auge auf Arten von sich noch entwickelnden Planeten hat. Obwohl sie nicht die Grsse der Navy hat, ist die UEE-Army der lteste Zweig des Militrs, der im Jahr 2380 als Teil der Grndung der United Nations of Earth ins Leben gerufen wurde. Die Hauptaufgabe der Army ist es Kriege zu gewinnen, indem sie eine schnelle und nachhaltige Landdominanz ber die gesamte Bandbreite militrischer Operationen gewhrleistet". Whrend die ffentlichkeit in den vergangenen Jahrhunderten vor allem in mchtige Kriegsraumschiffe und ihre Piloten verliebt war, rckte die UEE-Army whrend des ersten Tevarin-Krieges ins ffentliche Bewusstsein - etwa durch die Schlacht auf Idris IV, die dank der brillianten Taktik eines jungen Offiziers namens Ivar Messer zum grssten Wendepunkt des Krieges wurde.</span>

                        <br>
                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Marines</h2> <img src="https://www.ariscorp.de/assets/img/excurs/uee-reg/UEE_Marine.png" alt="UEE-Marines" style="float: right;" width="32%" height="auto">
                        <br> <br> <span>Sie sind Speerspitze und Schocktruppe gleichermassen. Die Marines wurden bis zum Ende des ersten Tevarin-Krieges unter dem Dach der Befehlstruktur der Army gefhrt. Erst danach wurde eine eigene Division daraus gebildet. Die UPE war der Meinung, dass sie eine konsolidierte Spezialeinheit brauchte, die das beste aus der Navy und der Army vereinigte. Ihr Fokus und ihre primre Aufgabe wurde die Invasion auf Planeten. Einheiten der Marines sind dabei reine Kriegswaffen. Sie kmmern sich nicht um Diplomatie oder hnliches. Wenn der Imperator sie nicht braucht, trainieren die Marines auf ihrer Basis auf Corin im Kilian-System. Kandidaten der Marines werden aus dem allgemeinen Pool der Rekruten der Army und der Navy ausgewhlt. Die Auswahlkriterien sind unbekannt.</span>

                        <br>
                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Brgerschaftsstatus</h2>
                        <br> <br> <span>Die breite ffentlichkeit besteht aus Zivilisten (Civilian). Jeder der auf einer mitgliedswelt der UEE geboren wird ist Zivilist und damit regestrierter Einwohner des UEE. Jeder Zivilist kann spter den Brgerstatus (Citizen) erreichen. Im Alter von siebzehn Standard- Erd-Jahren beginnen die Bewohner Stern zu zahlen, knnen eigentum besitzen und bei Wahlen und Gesetzgebungen abstimmen, wenn sie auf einem System registriert sind. Das grosse Ziel aber ist es Brger der UEE zu werden. Dies sind auserwhlte Mitglieder der Gesellschaft.</span>

                        <br>

                        <span>"Brger" zu sein ist dabei ein Status, der erst verdient werden muss. Hierfr muss man aktives Engagement fr die Interessender UEE zeigen, was durch einen hervorragenden Militrdienst, Zivildienst oder eine Bewerbung erfolgen kann.Brger haben diverse Vorteile. Ihnen ist zum Beispiel erlaubt, eine Multi-System-Corporation zu besitzen, ein politisches Bro zu betreiben, sie drfen bei UEE-Themen abstimmen und an Kommunalwahlen und an der Gesetzgebung mitwirken. Darber hinaus knnen sie UEE-Lizenzen zum Handel mit den Xi'an oder den Banu erwerben, ausserdem zahlen sie eine etwas geringere Ster. Verurteilten Kriminellen ist es hingegen nicht erlaubt, Brger zu werden. Wer darhaft gegen Ziehle und Vorschriften der UEEverstss, kann seinen Brger-Status auch wieder verlieren. Gleichwohl ist auch friedliches Leben ohne UEE- Staatsbrgerschaft mglich.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Transportwesen</h2>

                        <br>
                        <br>

                        <h3 style="font-family: 'Nasa'; float: left;">Am Boden</h3>

                        <br>
                        <br>

                        <span>Auch im 30. Jahrhundert existiert noch bodengebundener Verkehr. Vor allem auf den Grenzplaneten gibt es noch eine grosse Anzahl von Transporten. In den bevlkerungsreicheren Systemen existieren ebenfalls noch Strassen und Fahrzeuge, sie sind aber nicht mehr die dominierende Form des Planetarischen Transports. Diese Aufgabe haben HoverCars bernommen.</span>

                        <br>
                        <br>

                        <h3 style="font-family: 'Nasa'; float: left;">Im Weltall</h3>

                        <br>
                        <br>

                        <span>Fr die allgemein Bevlkerung sind Raumschiffe und Interplanetare Reisen eine Alltag gewordene Realitt,  aber das bedeutet nicht, dass jeder auch ein Raumschiff besitzt. Sie sind nicht so verbreitet wie Autos zu beginn des 21. Jahrunderts. Gleichzeitig ist die Raumfahrt nicht etwas fr die Reichen. Eine Vielzahl von Menschen mit unterschiedlichem sozialem und finanziellem Hitergrund sind zu den Sternen gegangen - in Schiffen der verschiedensten Preis- und Ausstatungskategorien.</span>

                        <br>
                        <br>

                        <h3 style="font-family: 'Nasa'; float: left;">In Atmosphren</h3>

                        <br>
                        <br>

                        <span>Wenn unzhlige fliegende Fahrzeuge die Stdte durchqren und zudem pausenlos Schiffe aus dem Orbit ankommen und abfliegen, sollte man meinen, dass es hufig Kollisionen gibt. Um diese Gefahr zu bannen, gibt es Flugkorridore, in denen Flge nur in eine Richtung erlaubt sind. Auch fr Raumschiffe existieren spezielle An- und Abflugrouten. Diese fhren zu denLandepltzen.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Kommerzieller Reiseverkehr</h2>

                        <br>
                        <br>

                        <img src="https://www.ariscorp.de/assets/img/excurs/uee-reg/Commercial.jpg" alt="Commercial-Flights" width="50%" height="auto">

                        <br>
                        <br>

                        <span>Alle Grossstdte verfgen ber mehrere ffentliche Verkehrsmittel. Prime verfgt beispielsweise ber eine U-Bahn sowie eine oberirdische Einschienenbahn. Wer keine lust hat auf die Bahn zu warten, kann in ein HoverCar Taxi steigen. Da nicht jeder ein Schiff besitzt, das in der Lage ist, zwischen Sternensystemen zu reisen, gibt es einen kommerziellen Raumfahrtmarkt. Diese Transporter sind in der Lage, Personen, Gter oder beides zu transportieren. Es gibt Fluggesellschaften, die sich auf die verschiedensten Bedrfnisse spezialisiert haben. Einige richten sich an Siedler, die zu den Grenzwelten wollen, whrend andere Luxuskreuzfahrten zum Goss-System anbieten. Der Earth-Pinecone Run war die erste kommerzielle Hauptverkehrsstrecke zwischen Sol und dem Ellis-System.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Sprungpunkte</h2>

                        <br>
                        <br>

                        <img src="https://www.ariscorp.de/assets/img/excurs/uee-reg/jumppoint.jpg" alt="Jump-Point" width="50%" height="auto">

                        <br>
                        <br>

                        <span>Der Wechsel zwischen den Systemen ist durch Sprungpunkte mglich. Jeder dieser Sprungpunkte ernglicht es, in kurzer Zeit grosse Entfernungen zu berwinden. Das Gebiet um den ersten von der Menschheit entdeckten Sprungpunkt wurde als Neso-Dreieck bezeichnet, weil Schiffe dort immer wieder spurlos verschwanden. Nick Croshaw entdeckte, dass die Anomalie eine Raum/Zeit Brcke warund navigierte erfolgreich hindurch. Er fand das Croshaw-System. Sprungpunkte sind fr das blosse Auge unsichtbar. Sie knnen nur mit przisen Scans gefunden werden - und auch nur dann, wenn man sie in einem bestimmten Winkel anfliegt. Der Bereich zwischen den beiden Sprungpunkten wird als Zwischenraum bezeichnet. Whrend sich die Wissenschaft oft gefragt hat, was dort existiert, ist jeder Versuch, den Zwischenraum zu erforsche, bislang gescheitert. In der Vergangenheit wurde der Zwischenraum oft als "verschwommene Raum/Zeit" beschrieben. Man hat das Gefhl, dass Ereignisse gleichzeitig vor und hinter einem liegen. Wenn ein Pilot durch einen nen Sprungpunkt navigiert ist, kann er die Daten an die UEE oder privat verkaufen.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Religion</h2>

                        <br>
                        <br>

                        <span>Obwohl es keine offizielle Religion gibt, die von der UEE anerkannt wird, gibt es in der Menschheit immer noch einen Bedarf nach dem Gttlichen. Die vorherschenden Religionen der vergangenheit existieren auch im 30. Jahrhundert noch. So gibt es im ganzen Universum Anhnger des Christentums, Judentums, Islam, Hinduismus, Buddhismus und vieler anderer. Viele Religionen haben sich mit der Zeit jedoch angepasst, etwa durch die Einbeziehung fremder Arten in ihre Lehren. Der Jahrtausendelange Groll und die Intoleranz zwischen den Religionen hat sich abgekhlt, teilweise aufgrund der Distanz zwischen den Welten, aber auch, weil die Stellung gegenber den Xi'An, Banu, Tevarin und Vanduul die Gemeinsamkeit zwischen den Menschengestrkt hat. Zudem sind eine Handvoll ner Religionen aufgetaucht. Die neusten Glaubenssysteme neigen jedoch dazu, eher humanistisch geprgt als offen religis zu sein. Einer der beliebtesten nen berzeugungen ist zum Beispiel die "Kirche des Reisens": Sie feiert Erfahrungen, die man auf seinen Reisen macht, anders gesagt: Das Leben ist das, was auf dem Weg passiert. Ihre Missionare werden Journeymen genannt und sie verbringen ihre Zeit damit, zu reisen, um Wissen durch Erfahrung zu erlangen.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Medizin</h2>

                        <br>
                        <br>

                        <span>Die Medizin hat im 30. Jahrundert einen unglaublichen stand erreicht. Die Menschen haben eine Lebenserwartung von ca. 130 Jahren erreicht  und eine vielzahl von frher unheilbaren Krankheiten konnten besiegt werden. Selbst verletzungen die frher unweigerlich den Tod zur folge gehabt htten knnen nun behandelt werden. Organde und Giedmasse knnen Wieder hergestellt werden, oder durch knstliche ersetzt werden. Selbst dem Tot kann heute in begrenztem masse umgangen werden. Dabei wird das  Bewustsein von verstorbenen Personen in einen Klonkrper bertragen. Diese Prozedur ist jedoch nur wenige male wegen des DNA zerfalls mglich, und auserdem eine auserordentlich Tere prozedur.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Kybernetik</h2>

                        <br>
                        <br>

                        <span>Kybernetik spielt im Alltag des 30. Jahrhunderts eine grosse Rolle und die Technologie ist in die Menschliche Anatomie integriert. Wie die meisten Dinge im Leben, gibt es hier preiswertere und teurere Modelle. Wenn man einen Ersatzarm will, der gut funktioniert und lebensecht aussieht, muss man dafr mehr bezahlen.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Simulanzen</h2>

                        <br>
                        <br>

                        <span>"Glcklicherweise" fr die Menschheit gibt es im 30. Jahrhundert noch Alkohol und andere Stimulanzien. Es gibt Fsser mit Whiskey, die langsam in Croshaw reifen, Souvignon Blanc-Trauben, die in Davien-System wachsen, und Bier, das auf Terra grt. Auch auf der narkotischen Seite gibt es ebenfalls legale und illegale Drogen, als da wren:</span>

                        <br>

                        <span>Stims- Legale Droge, bestehen aus Tabak, Koffein und Stimmungsaufhellern. Wird geraucht wie eine Zigarette. Billigere, geflschte Marken werden als Einzelpackungen verkauft, whrend High-End-versionen elektronische Zylinder mitaustauschbaren Kartuschen haben.</span>

                        <br>

                        <span>Slam- Ein Angsthemmer und Schmerzmittel. Am hufigsten als Gas eingenommen. Die Ampullen von Slam werden geknackt und inhaliert. Zrst gewann die Droge Popularitt als Steroid fr Athleten, bevor sie auf den Schwarzmarkt kam. Schwer abhngige Slam-Junkies sind in der ffentlichkeit leicht zu erkennen: Sie haben "das Zittern", leiden also unter unwillkrlichen Muskelzuckungen. Wichtig zu beachten ist, dass dies kein Zeichen fr den Entzug ist, sondern lediglich eine Nebenwirkung.</span>

                        <br>

                        <span>WiDoW- Dickes tintenhnliches, schwarzes Opiat. Wird ausschliesslich als Flssigkeit injiziert. Bei umfanglicher Anwendung werden die Venen schwarz gefrbt und es etstehen webartige subkutane Muster qr durch den gesamten Krper. </span>

                        <br>

                        <span>Neon- Clubdroge. hnlich wie Ecstasy. Leichte halluzinogene wirkung. Wirkt auf das Nervensystem beruhigend.</span>

                        <br>

                        <span>Maze- Strassenname fr ein Knock-out-Halluzinogen, das vermutlich von den Xi'An stammt. Muss oral eingenommen werden. Es is tdlich in hohen Konzentrationen. Viele, die es sich in die Venen injizieren, sterben sofort daran. Der Krper muss sich daran gewhnen und es verdan. Wirkt wie eine Reise durch den eigenen Kopf. Nach aussen hin wirkt man wie im Koma? im innern ist es eine Wilde Reise. Eine Handvoll Religionen wurden nach der Einnahme von Maze gegrndet. Abgesehen von dem giftigen Element besteht die Gefahr, dass man nicht mehr davon runterkommt. Unter Junkies heisst das "getrennt werden". Die benutzer bleiben in ihrem eigenen Kopf eingeschlossen, bis ihr Gehirn schliesslich zerfllt.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Technologie Im Alltag</h2>

                        <br>
                        <br>

                        <span>berall im Verse finden sich Konsolen - von den Schirmen auf der Kommandozentrale eines Bengal- Trgers bis zu den kleinen Monitoren im Cockpit des eigenen Schiffes. Alle haben Standard6 Touchscreen- Schnittstellen mit virtllen Tastaturen.</span>

                        <br>

                        <span>Wandschirme sin genau das, wonach es klingt: eine dnne, Flexible Folie, die sich an jede Wandgrsse anpassen lsst und als Kombination aus Fernesehen und Computer-displays fungiert. Die meisten Wand schirme sind gleichzeitig Touchscreens und High-End- Modelle erkennen Handbefehle. </span>

                        <br>

                        <span>Auch Holografische Projekttionen sind berall im verse allgegenwertig. Egal ob Werbetafeln oder Informations-displays. </span>

                        <br>

                        <span>Das Mobiglas ist das Standart-gert des tglichen Lebens. Dieses kleine, handliche gert vereint Nachrichten, Spectrums-Updates,  Bank und Tradinggeschfte, Persnliche Kommunikation und vieles mehr. Esist das furtureistische quivalent zum Smartphone des 21. Jahrhunderts - Jeder hat eines. </span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Roboter</h2>

                        <br>
                        <br>

                        <span>Es gibt Drohnen, die helfen, Schiffe zu reparieren, Kehrbots sprhen die Strassen der Stdte und sammeln den Mll. Es gibt jedoch keine lebensechten Roboter. Roboter sind Werkzeuge, keine Ersatz-Menschen. Computer knnen Billionen Entscheidungen pro Sekunde treffen. Trotzdem ist die Menschen nicht in der Lage, emotionale Prozesse des Gehirns zu replizieren.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Medien</h2>

                        <br>
                        <br>

                        <span>Das Netz der der Informationen und Unterhaltung wird als Spectrum bezeichnet. Es gibt Filme und Shows namens Vids, die praktisch alle auf Abruf frei zugnglich sind. Bcher? Malerei und Musik sind ausschliesslich digital. Es gibt Prominente und NewsOrgs bringen lokale Abendnachrichten und produzieren Online-Zeitungen. Dies sind die aktllen grossen NewsOrgs. </span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">New United</h2>

                        <br>
                        <br>

                        <span>New United ist seit Jahrhunderten eine altherwrdige Nachrichtenorganisation. Ursprnglich United Times genannt, war es eines der letzten berreste der Zeitungskonzerne des 20./21. Jahrhunderts. Whrend der Messer-ra wurde das Papier nach einer Fusion mit der Sentinel Tribune im Jahr 2578 zum inoffiziellen Propagandadienst der faschistischen UEE-Regierung. Als die Messer-ra unterging, startete die NewsOrg 2792 als New United neu, um sich von den Snden der Vergangenheit zu distanzieren und verpflichtete sich, sich nie wieder politischen Druck zu beugen.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Terra Gazette</h2>

                        <br>
                        <br>

                        <span>Die terrabasierte NewsOrg versuchte zwar zunst, ihre Unabhngigkeit whrend der Messer-ra zu bewahren, wurde aber infiltriert und von dere herschenden Meinung abweichende Reporter wurden gechtet, als die NewOrg in die Propagandamaschiene integriert wurde. Heute wird die Terra Gazette in erster Linie als eine bevor mundende Nachrichtenqlle angesehen. </span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">SSN/CAtv</h2>

                        <br>
                        <br>

                        <span>Vorwiegend Vid-bassierte NewsOrg. Betreibt Filialkanle in fast jedem System. Vollgepackt mit Debattenshows wie "Showdown" und reinen Nachtrichensendungen.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Kriminalitt</h2>

                        <br>
                        <br>

                        <span>Die Zeiten sind hart. Sowohl Brger als auch Zivilisten leben in strmichen Zeiten. Es mangelt nich an Grnden, warum Menschen sich einem kriminelen Leben zuwenden. Es gibt Drogenhandel,Diebsthle, Morde und Korruption in jeder Ecke des bekannten Universums.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Piraterie</h2>

                        <br>
                        <br>

                        <span>Piraterie ist eine wachsende Epedeie in der UEE. Piraten knnen allein oder in Gruppen  arbeiten. Was Kriminalitt betrifft, so sind Piraten die einfallsreichsten. Jedes Rudel arbeitet nach einem locker festgelegten Regelwerk, aber es gibt wenig Kameradschaft zwischen den Piraten, da sie sich so oft auch gegenseitig bestehlen, wie sie von Zivilisten stehlen oder ohne einen Moment zu zgern ihre Konkurenten verraten. Einige arbeiten mit einem Codex der einen oder anderen Art, aber die meisten interessieren sich fr nichts, als sich selbst.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Schmuggler</h2>

                        <br>
                        <br>

                        <span>Der Transport Illegaler Fracht ist fr viele Spediteure zu einer guten Mglichkeit geworden, nebenbei ein paar Credits zu verdienen. Von gestohlenen Waren ber illegale Drogen bis hin zu Waffen und Sklaven wird alles geschmuggelt. Manchmal wissen nicht einmal die Schmuggler selbst, was sie transportieren - es steht eben nur eine weitere Kiste zwischen ihrer regulren Ladung.Professionelle Schmuggler nutzen hingegen oft alle Arten von technologischen Tuschungen, um ihre Ladung vor den Augen von Zoll-, rtlichen-Strafverfolgungsbehrden oder vor der Advocacy zu verstecken. Sie verfgen ber Gegenscan- Technologien, geflschte Schiffsetiketten, Dummy-Kisten oder sogar verdeckte Laderume auf ihren Schiffen.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Sklavenhndler</h2>

                        <br>
                        <br>

                        <span>Selbst unter Kriminellen werden Sklavenhndler als Abschaum angesehen. Dennoch existiert Sklaverei immer noch in manchen Ecken der UEE. Einige skrupellose Corps arbeiten mit Sklavenhndlern zusammen, um so Mitarbeiter fr entfernte Bergbaugebiete zu "rekrutieren". Sklaven werden auch gehandelt, um in Gladiator-Arenen zu kmpfen oder fr Wissenschaftliche Experimente. Sklaven knnen aus jeder Kultur stammen: Mensch, Banu, Tevarin, oder Xi'An. Einige Sklavenhndler sind sich nicht zu schade, Ausserirdische von Planeten zu entfhren, die unter dem Schutz des "Fair Chance Acts" stehen. Entfhrungen geschehen sowohl in den grossen Stdten als auch in abgelegenen Siedlungen. Sklavenhndler arbeiten mit verschiedenen Methoden. Einige werfen Sklaven in einen Kfig wie jede andere lebende Ladung, whrend andere ihre Produkte betuben und in scangeschtzten Srgen transportieren. Manchmal werden ihnen kleine Tracking-Sender implantiert, damit ihr Besitzer sie leicht lokalisieren kann, aber auch um anzuzeigen, dass sie versklavt sind.</span>

                        <br>
                        <br>

                        <h2 style="font-family: 'Nasa'; float: left;">Syndikate</h2>

                        <br>
                        <br>

                        <span>Wer sagt, dass Verbrechen sich nicht bezahlt macht, hat darber noch nie in grsseren Massstab nachgedacht. Verbrechen kann lukrativ sein, wenn man die Ressourcen hat, um seine Spuren zu verwischen. Syndikate sind gruppen von Personen, die als eine Einheit fr ausschliesslich kriminelle Zwecke miteinander verbunden sind. Es gibt wahrscheinlich hunderte Syndikate verschiedener Grsse in der gesammten UEE. Die grsseren Syndikate erbringen eine Vielzahl illegaler "Dienstleistungen" wie Drogen- und Sklavenhandel sowie Schmuggel, whrend andere eher spezialisiert sind und etwa als Killerkommandos unterwegs sind. Einige Syndikate wollen, dass ihr Name Gewicht hat, whrend andere es vorziehen, sich dem ffentlichen Bewusstsein zu etziehen.</span>

